INSERT INTO `ce_sightseen` VALUES (54,'Chaophraya dinner Cruise on sic ','cruise.jpg','','','','<p><em><strong>Itinerary</strong></em></p><p><strong>19.30</strong>Check in at River City Pier 1, Siphraya (Charoen Krung 30 Rd.). Warm welcome from our receptionists.<br />&nbsp;</p><p><strong>19.45</strong>Depart River City Pier. Our waiters and waitresses bring you to your designated seats and a welcome drink fruit punch is served along with snacks. Our singer introduces safety regulations in case of emergency.<br />&nbsp;</p><p><strong>20.00</strong>Dinner: Select your desired dishes from our international buffet bar. Our musicians begin singing easy-listening jazz songs to complement with your meal.<br />&nbsp;</p><p><strong>21.00</strong>Time for a dance! Our singer selects cultural and international upbeat songs to sing and dance with you.<br />&nbsp;</p><p><strong>21.45</strong>Arrive River City Pier.</p>',29,313,22594,'<p><strong>Pick up time from Hotel &nbsp;1800 hrs&nbsp;</strong></p><p><strong>Drop at hotel 22.30 hrs&nbsp;</strong></p><p><strong>Duratuion 02 hrs</strong></p><ol><li><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></li><li><strong>Emergency contact: Mr Num 0830769322</strong></li><li><strong>Office mobile no:&nbsp; 0943517644</strong></li></ol><p><em><strong>Important&nbsp;Note :-&nbsp;</strong></em></p><p><em><strong>1. SIC available for hotels in city center located in area of Silom, Sathorn, Siam Square, Pratunam, Chidlom, Ploenchit, Sukhumvit Road (Soi 1-55 only) SIC Tour is require a minimum of 2 persons.</strong></em></p><p><em><strong>2.&nbsp;</strong></em>Please call at least 24 hours prior to departure to confirm schedule</p>',0,0),(55,'Chaophraya Dinner Cruise ( Ticket Only )','cruise.jpg','','','','<p><em>Itinerary</em></p><p>19.30Check in at River City Pier 1, Siphraya (Charoen Krung 30 Rd.). Warm welcome from our receptionists.<br />&nbsp;</p><p>19.45Depart River City Pier. Our waiters and waitresses bring you to your designated seats and a welcome drink fruit punch is served along with snacks. Our singer introduces safety regulations in case of emergency.<br />&nbsp;</p><p>20.00Dinner: Select your desired dishes from our international buffet bar. Our musicians begin singing easy-listening jazz songs to complement with your meal.<br />&nbsp;</p><p>21.00Time for a dance! Our singer selects cultural and international upbeat songs to sing and dance with you.<br />&nbsp;</p><p>21.45Arrive River City Pier.</p>',25,313,22594,'<p>Adress :-River City Soi Charoenkrung 30 Charoenkrung rd. Bangrak, Bangkok</p><p>Ckeck in Time 1930</p><p>Duratuion 02 hrs</p><ol><li>Emergency contact: Ms Fon 0891599379, 0830541636</li><li>Emergency contact: Mr Num 0830769322</li><li>Office mobile no:&nbsp; 0943517644</li></ol><p>Note :-&nbsp;Please call at least 24 hours prior to departure to confirm schedule</p>',0,0),(56,'Alcazar Cabaret show Ticket only','images (1).jpg','lady.jpg','','','<p>Alcazar Cabaret&#39;s theater features 1,200 seats and a small team of 400 male and ladyboy artists who give dazzling and fantastic performances including impersonation, comedy and other delighting performance. Not only the unique performance that will entertain the audience but well-designed backdrops, lighting, sound and embellishing outfits.</p>',10,313,22714,'<p>It is said a trip to Pattaya is never complete without a visit to the famous Alcazar Cabaret.</p><p>Show Timings:&nbsp;17:00, 18:30, 20:00, and 21:30</p><p>Duration: Approx 70 Minutes</p><p><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></p><p><strong>Emergency contact: Mr Num 0830769322</strong></p><p><strong>Office mobile no:&nbsp; 0943517644</strong></p><p>&nbsp;</p><p><strong>NOTE: Please call atlease 24 hours prior to departure to confirm the schedule.</strong></p>',0,0),(57,'Alcazar Cabaret show on SIC (Normal Seat) ','images (1).jpg','lady.jpg','','','<p>Alcazar Cabaret&#39;s theater features 1,200 seats and a small team of 400 male and ladyboy artists who give dazzling and fantastic performances including impersonation, comedy and other delighting performance. Not only the unique performance that will entertain the audience but well-designed backdrops, lighting, sound and embellishing outfits.</p>',13,313,22714,'<p>It is said a trip to Pattaya is never complete without a visit to the famous Alcazar Cabaret.</p><p>Show Timings:&nbsp;17:00, 18:30, 20:00, and 21:30</p><p>Duration: Approx 70 Minutes</p><p><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></p><p><strong>Emergency contact: Mr Num 0830769322</strong></p><p><strong>Office mobile no:&nbsp; 0943517644</strong></p><p>&nbsp;</p><p><strong>NOTE: Please call atlease 24 hours prior to departure to confirm the schedule.</strong></p><p>&nbsp;</p>',0,0),(58,'SIAM NIRAMIT SHOW ON SIC  ( without dinner )','siamniramit.jpg','','','','<p>&nbsp;</p><p>Siam Niramit combines an authentic Thai buffet with a world-class stage show depicting Thailand&#39;s historical and spiritual heritage. With over 150 dazzling performers and state-of-the-art special effects, it&rsquo;s a captivating journey. The first act describes how Siam became a cross-roads where civilisations met, the second how karma binds Thai people, and the final act shows how religious ceremony earns Thai people merit in this life. In addition to the show, you can visit replica villages from the country&#39;s rural regions and buy Thai handicrafts.</p>',33,313,22594,'<p>Timing :- 17:30-22:00</p><p>Travel back in time to the early history and culture of the Kingdom of Siam. You will be amazed and captivated by this two-hour long journey, which delves into over 700 years of Thai history in three stage acts, including the ancient civilisations, spiritual discovery and Thai festivals. Before the show, stroll though the replica villages of the four regions and try your hand at making Thai desserts, crafts or simply enjoy the lovely atmosphere.</p><p>The Siam Niramit (Bangkok) show starts daily at 20.00hrs. Show duration is 80 minutes, without intermission. Gates open at 17.30hrs. for access to restaurant, other attractions and facilities. A free shuttle service runs from Exit 1 of Thailand Cultural Centre MRT Station. New Tour Info Point</p><p>Duration 04 hrs&nbsp;</p><ul><li><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></li><li><strong>Emergency contact: Mr Num 0830769322</strong></li><li><strong>Office mobile no:&nbsp; 0943517644</strong></li></ul><p><em><strong>Note :</strong></em>-&nbsp;Please call at least 24 hours prior to departure to confirm schedule. Pick up and drop off are available at all the major city hotels except hotels located outside city limit. SIC available for hotels in city center located in area of Silom, Sathorn, Siam Square, Pratunam, Chidlom, Ploenchit, Sukhumvit Road (Soi 1-55 only) SIC Tour is require a minimum of 2 persons.</p><p><strong>Pick up time informed by are bangkok representive&nbsp;</strong></p>',0,0),(59,'SIAM NIRAMIT SHOW ON SIC  ( with dinner )','siamniramit.jpg','','','','<p>Siam Niramit combines an authentic Thai buffet with a world-class stage show depicting Thailand&#39;s historical and spiritual heritage. With over 150 dazzling performers and state-of-the-art special effects, it&rsquo;s a captivating journey. The first act describes how Siam became a cross-roads where civilisations met, the second how karma binds Thai people, and the final act shows how religious ceremony earns Thai people merit in this life. In addition to the show, you can visit replica villages from the country&#39;s rural regions and buy Thai handicrafts.</p>',41,313,22594,'<p>Timing :- 17:30-22:00</p><p>Travel back in time to the early history and culture of the Kingdom of Siam. You will be amazed and captivated by this two-hour long journey, which delves into over 700 years of Thai history in three stage acts, including the ancient civilisations, spiritual discovery and Thai festivals. Before the sho