ick up timing: 0800 Hrs</p><p>Min: 2 Pax requires</p><p>&nbsp;</p><p><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></p><p><strong>Emergency contact: Mr Num 0830769322</strong></p><p><strong>Office mobile no:&nbsp; 0943517644</strong></p><p>&nbsp;</p><p><strong>NOTE: Please call atlease 24 hours prior to departure to confirm the schedule.</strong></p>',0,0),(61,'SIAM NIRAMIT SHOW Ticket Only  ( without dinner )','siamniramit.jpg','','','','<p>Siam Niramit combines an authentic Thai buffet with a world-class stage show depicting Thailand&#39;s historical and spiritual heritage. With over 150 dazzling performers and state-of-the-art special effects, it&rsquo;s a captivating journey. The first act describes how Siam became a cross-roads where civilisations met, the second how karma binds Thai people, and the final act shows how religious ceremony earns Thai people merit in this life. In addition to the show, you can visit replica villages from the country&#39;s rural regions and buy Thai handicrafts.</p>',27,313,22594,'<p>Timing :- 17:30-22:00</p><p>Travel back in time to the early history and culture of the Kingdom of Siam. You will be amazed and captivated by this two-hour long journey, which delves into over 700 years of Thai history in three stage acts, including the ancient civilisations, spiritual discovery and Thai festivals. Before the show, stroll though the replica villages of the four regions and try your hand at making Thai desserts, crafts or simply enjoy the lovely atmosphere.</p><p>The Siam Niramit (Bangkok) show starts daily at 20.00hrs. Show duration is 80 minutes, without intermission. Gates open at 17.30hrs. for access to restaurant, other attractions and facilities. A free shuttle service runs from Exit 1 of Thailand Cultural Centre MRT Station. New Tour Info Point</p><p>Duration 04 hrs&nbsp;</p><ul><li><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></li><li><strong>Emergency contact: Mr Num 0830769322</strong></l