n 0891599379, 0830541636</strong></li><li><strong>Emergency contact: Mr Num 0830769322</strong></li><li><strong>Office mobile no:&nbsp; 0943517644</strong></li></ul><p><em><strong>Note :-</strong></em>&nbsp;Please call at least 24 hours prior to departure to confirm schedule. Pick up and drop off are available at all the major city hotels except hotels located outside city limit. SIC available for hotels in city center located in area of Silom, Sathorn, Siam Square, Pratunam, Chidlom, Ploenchit, Sukhumvit Road (Soi 1-55 only) SIC Tour is require a minimum of 2 persons.</p>',0,0),(63,'Dream World + Lunch + Snow Town+4D on sic ','DREAM-WORLD.jpg','','','','<p>With a day out at Dream World you and the kids will get to experience the spectacular atmosphere of this huge amusement park, and savour the exciting shows and rides in its four themed lands of dreams. Set in beautifully landscaped gardens, there are linked paths, pools, legendary castles and more than 30 exciting rides for everyone to enjoy.</p>',28,313,22594,'<p>&nbsp;</p><p>Pick up Time from Hotel 0830 hrs&nbsp;</p><p><em><strong>Daily 10:00-17:00&nbsp;</strong></em></p><p>Enjoy the exciting rides in this extraordinary amusement park, delight in the Hollywood Action Show and marvel at the beautifully designed grounds with magnificently sculpted gardens, Thai Village... and so much more.</p><p>&nbsp;</p><ul><li><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></li><li><strong>Emergency contact: Mr Num 0830769322</strong></li><li><strong>Office mobile no:&nbsp; 0943517644</strong></li></ul><p><em><strong>Includes</strong></em></p><ul><li>Round trip transfer from/to hotels in Bangkok. (except the customer who buy Ticket Only program).</li><li>Entrance fee with rides only and Snow town.</li></ul><p><em><strong>Excludes</strong></em></p><ul><li>Personal expenses such as tips, drink, etc.</li><li>Go-Kart, Air-Gun and Carnival Games</li><li>Other service not mentioned on this program</li></ul><p>&nbsp;</p><p><em><strong>Note :-&nbsp;</strong></em>Please call at least 24 hours prior to departure to confirm schedule. Pick up and drop off are available at all the major city hotels except hotels located outside city limit. SIC available for hotels in city center located in area of Silom, Sathorn, Siam Square, Pratunam, Chidlom, Ploenchit, Sukhumvit Road (Soi 1-55 only) SIC Tour is require a minimum of 2 persons.</p>',0,0),(67,'Noong Nuch Village on SIC','Nong_Nooch.jpg','','','','<p>Stroll through the beautiful gardens of Nong Nooch just a short distance from Pattaya and discover the largest botanical gardens in Thailand.<br /><br />After a hotel pick-up from Pattaya, drive to Nong Nooch and explore more than 600 acres of landscaped gardens, including traditional Asian tropical gardens, a cactus garden and a butterfly garden.<br /><br />The gardens are constantly evolving with flowers that include a variety of orchids and species that can only be found in Thailand. In addition, visit the miniature open zoo and aviary, where you can watch an elephant show featuring the magnificent symbols of Siam performing various tricks, such as bike-riding and playing football.<br /><br />Next, take in the Cultural Extravaganza, performed 4 times a day, and experience the pomp and splendour of Thai traditions and ceremonies. Watch graceful dances from all over the country, as well as sword fights, Thai kickboxing, and much more.</p><p>&nbsp;</p><p><strong>THINGS TO DO</strong></p><ul><li>Stroll through the vast botanical gardens of Nong Nooch</li><li>See Asian elephants perform tricks, including dancing and playing with the crowd</li><li>Admire birds of prey, water birds and reptiles in the mini zoo</li><li>Discover the unique pottery sculptures of the Pottery Garden</li><li>Admire a recreation of Stonehenge in tropical Thailand</li><li>Watch sword fights and traditional dances during a 1-hour cultural show</li></ul><p><strong>EXCLUSIONS</strong></p><ul><li>Meals</li></ul><p>&nbsp;</p>',18,313,22714,'<ul><li><strong>Opening Hours</strong>: 09:00 &ndash; 17:00</li><li><strong>Location</strong>: Km. 163, Sukhumvit Road (Highway 3)</li></ul><p>&nbsp;</p><p><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></p><p><strong>Emergency contact: Mr Num 0830769322</strong></p><p><strong>Office mobile no:&nbsp; 0943517644</strong></p><p>&nbsp;</p><p><strong>NOTE: Please call atlease 24 hours prior to departure to confirm the schedule.</strong></p>',0,0),(68,'Noong Nuch Village Ticket only','Nong_Nooch.jpg','','','','<p>Stroll through the beautiful gardens of Nong Nooch just a short distance from Pattaya and discover the largest botanical gardens in Thailand.<br /><br />After a hotel pick-up from Pattaya, drive to Nong Nooch and explore more than 600 acres of landscaped gardens, including traditional Asian tropical gardens, a cactus garden and a butterfly garden.<br /><br />The gardens are constantly evolving with flowers that include a variety of orchids and species that can only be found in Thailand. In addition, visit the miniature open zoo and aviary, where you can watch an elephant show featuring the magnificent symbols of Siam performing various tricks, such as bike-riding and playing football.<br /><br />Next, take in the Cultural Extravaganza, performed 4 times a day, and experience the pomp and splendour of Thai traditions and ceremonies. Watch graceful dances from all over the country, as well as sword fights, Thai kickboxing, and much more.</p><p>&nbsp;</p><p><strong>THINGS TO DO</strong></p><ul><li>Stroll through the vast botanical gardens of Nong Nooch</li><li>See Asian elephants perform tricks, including dancing and playing with the crowd</li><li>Admire birds of prey, water birds and reptiles in the mini zoo</li><li>Discover the unique pottery sculptures of the Pottery Garden</li><li>Admire a recreation of Stonehenge in tropical Thailand</li><li>Watch sword fights and traditional dances during a 1-hour cultural show</li></ul>