 off are available at all the major city hotels except hotels located outside city limit. SIC available for hotels in city center located in area of Silom, Sathorn, Siam Square, Pratunam, Chidlom, Ploenchit, Sukhumvit Road (Soi 1-55 only) SIC Tour is require a minimum of 2 persons.</p>',0,0),(70,'Safari world and marine park with lunch on sic ','safari.jpg','','','','<p>&nbsp;</p><p>Thailand&#39;s Greatest open zoo and leisure park that offers a great variety of entertainment. Whether it is an exciting safari drive through the picturesque African wilderness settings, an intimate encounter with friendly dolphins or an exhilarating fast-paced action stunt spectacle, Safari World has it! - A family friendly tour with kids.</p>',26,313,22594,'<p><strong>Duration:&nbsp;</strong>Full Day<br /><strong>Hotel&nbsp;Pick up Time:&nbsp;</strong>08:00 a.m. (approx)</p><p>Start at 10.00 hrs&nbsp;</p><p>Drop at Hotel aprox 1600 hrs&nbsp;</p><ul><li><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></li><li><strong>Emergency contact: Mr Num 0830769322</strong></li><li><strong>Office mobile no:&nbsp; 0943517644</strong></li></ul><p><em><strong>Note :-</strong></em>&nbsp;Please call at least 24 hours prior to departure to confirm schedule. Pick up and drop off are available at all the major city hotels except hotels located outside city limit. SIC available for hotels in city center located in area of Silom, Sathorn, Siam Square, Pratunam, Chidlom, Ploenchit, Sukhumvit Road (Soi 1-55 only) SIC Tour is require a minimum of 2 persons.</p>',0,0),(71,'Safari world and marine park with lunch ( Ticket Only )','safari.jpg','','','','<p>Thailand&#39;s Greatest open zoo and leisure park that offers a great variety of entertainment. Whether it is an exciting safari drive through the picturesque African wilderness settings, an intimate encounter with friendly dolphins or an exhilarating fast-paced action stunt spectacle, Safari World has it! - A family friendly tour with kids.</p