ul><p><em>Note :-&nbsp;</em>Entrance fee with private transfer Please call at least 24 hours prior to departure to confirm schedule. Pick up and drop off are available at all the major city hotels except hotels located outside city limit. SIC available for hotels in city center located in area of Silom, Sathorn, Siam Square, Pratunam, Chidlom, Ploenchit, Sukhumvit Road (Soi 1-55 only) SIC Tour is require a minimum of 2 persons.</p>',0,0),(83,'Madam Tussauds with transfers ','madam.jpg','','','','<p>With 10 exhibit rooms decked out in real-life themes, the museum feels more like a journey from one time-warp to the next &ndash; Lady Di next to Mao Zedong, Pablo Picasso and his Cubist painting next to Thailand&rsquo;s leading and somewhat eccentric forensic pathologist Dr. Porntip Rojanasunan in her full rock star regalia, Barak and Michelle Obama in their Oval Office next to Aung San Suu Kyi and the Dalai Lama.</p><p>Out of the 10 rooms, The Royal Room is the most elegant and culturally significant, as it showcases the wax figures of HRH Prince Mahitala Thibed Adulyadej and HRH Princess Srinagarindra, the late parents of His Majesty the King. All the decorative elements in this room are meticulously planned down to the tiniest details, whether the royal costumes, colour scheme, floral graphic patterns and music, all of which received the Royal endorsement from the Thai Royal family. This is the only room in which you are not allowed to touch the figures.</p><p>A controversial political personality, Chairman Mao seems to get more attention from visitors than Princess Diana or Queen Elizabeth II. But the most photographed is probably a section of the Oval Office, with the U.S. President and First Lady posing by the festoon curtains.</p>',30,313,22594,'<p><strong><em>Timing :-</em></strong></p><p><strong><em>10.00 to 1200 hrs</em></strong></p><p><strong><em>1300 to 1500 hrs</em></strong></p><p><strong><em>1530 to 1730 hrs</em></strong></p><ul><li><strong>Emergency contac