ting and selling items from the four major parts of Thailand (north, northeast, central and south). Expect to find many eateries, fruit stalls, souvenir shops and some art galleries. There is also a cultural show every afternoon.&nbsp;The 350 million baht market has over 114 shops and water vendors selling authentic Thai food, desserts and specialties from all over the kingdom. For a floating market experience, hire a man-powered boat to get around and discover the richness of the surrounding Thai architecture and riverside life.&nbsp;</p><p>&nbsp;</p><p>Pattaya Floating Market not only presents cultures and traditions from different regions of Thailand but also presents niche products from there, such as wooden sculpture, silverware, textile, paper handcrafts, sailing-boat model, wooden-handmade bags, Thai silk, and so on. Not surprisingly, the visitors usually buy souvenirs or gifts for their friends and their family from this floating Market.</p>',5,313,22714,'<p>Timings: 10:00 - 1200 Hrs</p><p>&nbsp;</p><p><strong>Includes:&nbsp;</strong></p><ul><li>Admission fee as mentioned on this program.&nbsp;</li></ul><p><strong>Excludes:</strong></p><ul><li>Personal expenses such as drinks, tips, insurance etc.&nbsp;</li><li>Meal&nbsp;</li><li>Other service not mentioned on this program &nbsp;</li></ul><p><strong>Min: 2 Pax Required</strong></p><p><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></p><p><strong>Emergency contact: Mr Num 0830769322</strong></p><p><strong>Office mobile no:&nbsp; 0943517644</strong></p><p>&nbsp;</p>',0,0),(88,'Floating Market SIC','floating-market.jpg','','','','<p>Covering an area of 100,000sqm, the Four Regions Floating Market is separated into four sections &ndash; each representing and selling items from the four major parts of Thailand (north, northeast, central and south). Expect to find many eateries, fruit stalls, souvenir shops and some art galleries. There is also a cultural show every afternoon.&nbsp;The 350 million