r, elephant, crocodile and pig shows. Not enough thrills? Then meet the &lsquo;Scorpion Queen&rsquo;, the lady who set the Guinness World Record in 2008 for &lsquo;The Longest Stay with Scorpions&rsquo;, by staying in a 12sqm room with 5,000 adult scorpions for 33 days. Otherwise, head over to the animal zone and watch rare wild animals, such as single-humped camels, deer, ostriches and wallabies, up close. The Elephant Museum features a collection of life-sized elephant figures, from the extinct species like mammoths to the war elephants of ancient Thailand to today&rsquo;s wild Asia and African elephants.</p>',7,313,22714,'<p><strong>Opening Hours</strong>: 08:00 &ndash; 18:00</p><p><strong>Show Time: </strong>10:30 a.m. and 15:00 p.m.</p><p>Min 2 Pax required</p><p>&nbsp;</p><p><strong>Includes:&nbsp;</strong></p><ul><li>Admission fee as mentioned on this program.&nbsp;</li></ul><p><strong>Excludes:</strong></p><ul><li>Personal expenses such as drinks, tips, insurance etc.&nbsp;</li><li>Meal&nbsp;</li><li>Other service not mentioned on this program &nbsp;</li></ul><p>&nbsp;</p><p><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></p><p><strong>Emergency contact: Mr Num 0830769322</strong></p><p><strong>Office mobile no:&nbsp; 0943517644</strong></p><p>&nbsp;</p><p><strong>NOTE: Please call atlease 24 hours prior to departure to confirm the schedule.</strong></p>',0,0),(94,'Sriracha Tiger Zoo on SIC','pty-tigerzoo01.jpg','','','','<p>. The zoo is divided into four zones: tiger breeding zone, talent show zone, crocodile zone and animal zone. The main attraction is the tiger cub feeding room, which showcases tiger cubs and piglets living and feeding in the same cage. For an extra fee, you can feed the cubs and have your picture taken with them.<br /><strong>Pattaya Sriracha Tiger Zoo</strong>&nbsp;is one of the outstanding attractions in Pattaya, Thailand. You can enjoy a variety of animal shows such as&nbsp;<strong>Crocodile Shows, Tiger Shows, Elephant Shows and Pig Shows</strong>.</p><p>The zoo offers daily tiger, elephant, crocodile and pig shows. Not enough thrills? Then meet the &lsquo;Scorpion Queen&rsquo;, the lady who set the Guinness World Record in 2008 for &lsquo;The Longest Stay with Scorpions&rsquo;, by staying in a 12sqm room with 5,000 adult scorpions for 33 days. Otherwise, head over to the animal zone and watch rare wild animals, such as single-humped camels, deer, ostriches and wallabies, up close. The Elephant Museum features a collection of life-sized elephant figures, from the extinct species like mammoths to the war elephants of ancient Thailand to today&rsquo;s wild Asia and African elephants.</p>',21,313,22714,'<p><strong>Opening Hours</strong>: 08:00 &ndash; 18:00</p><p><strong>Show Time:&nbsp;</strong>10:30 a.m. and 15:00 p.m.</p><p>Min 2 Pax required</p><p>&nbsp;</p><p><strong>Includes:&nbsp;</strong></p><ul><li>Admission fee as mentioned on this program.&nbsp;</li><li>Round trip airport transfers for Hotel</li></ul><p><strong>Excludes:</strong></p><ul><li>Personal expenses such as drinks, tips, insurance etc.&nbsp;</li><li>Meal&nbsp;</li><li>Other service not mentioned on this program &nbsp;</li></ul><p>&nbsp;</p><p><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></p><p><strong>Emergency contact: Mr Num 0830769322</strong></p><p><strong>Office mobile no:&nbsp; 0943517644</strong></p><p>&nbsp;</p><p><strong>NOTE: Please call atlease 24 hours prior to departure to confirm the schedule.</strong></p>',0,0),(95,'Ripleys believe it or not Ticket only','ripleys.jpg','','','','<p>Ripley&#39;s World of Entertainment is located on 2nd&nbsp;Floor of Royal Garden Plaza, Pattaya. It features world class entertainment attractions where everybody can enjoy, relax, and entertain friends, family and colleagues during weekends, vacations and all other occasions.</p><p>Welcome to the World&rsquo;s most unusual museum, Ripley&#39;s Believe It or Not! Museum in Pattaya. The museum features are 350 fascinating real exhibits and things you can&rsquo;t see anywhere else. Be exhilarated with Ripley&rsquo;s 4D Moving Theater, a high-tech simulator amusement ride guaranteed to thrill both the mind and body. Venture into your worst nightmares at Ripley&rsquo;s Haunted Adventure. Be dazzled with imaginable special effects and live actors that will send shivers down your spine from the moment you enter &lsquo;til the time you escape! Journey into new magical worlds at Ripley&rsquo;s Infinity Maze. A 20-minutes trip into the Maze will challenge your perception, mesmerize all your senses and make your question reality! Also the most unique &quot;toy&quot; in town Wax Hand Fun. Try it... see how much fun and amazing your hand can be</p>',25,313,22714,'<p><strong>Opening Hours</strong>: 11:00 &ndash; 23:00</p><p>Min 2 Pax required</p><p>&nbsp;</p><p><strong>Includes:&nbsp;</strong></p><ul><li>Admission fee as mentioned on this program.&nbsp;</li></ul><p><strong>Excludes:</strong></p><ul><li>Personal expenses such as drinks, tips, insurance etc.&nbsp;</li><li>Meal&nbsp;</li><li>Other service not mentioned on this program &nbsp;</li></ul><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p>',0,0),(96,'Damnern Saduak Floating Market + River Kawai + Lunch and Tiger temple ','tiger-temple-kanchanaburi.jpg','','','','<p><strong>Tour Itinerary</strong>&nbsp;<br /><br />06:30-07:15 - Depending upon your hotel location, pick up time will be advised at the time of reservation.<br /><br />Pick up at the lobby of your hotel and other tourists and drive out of Bangkok, heading southwest to Ratchaburi province&nbsp;<br /><br />08:30 - Arrive at the jetty pier and take a long-tailed boat ride along the winding canal to the floating market. You will see Thai traditional village life, old Thai houses, greenish gardens and temples.&nbsp;<br /><br />09:00 - At the Damnoen Saduak Floating Market, you can see active market life of people selling and buying things on their boats. There are different boats in all shapes and sizes and you can find variety of local goods, food, and fruits. (Paddling Boat is optional at 150 Baht per person)&nbsp;<br /><br />11:30 - Visit Handicraft Home Industry where you can see skillful craftsmen working on teakwood carving.&nbsp;<br /><br />12:30 - Enjoy lunch at a local restaurant&nbsp;<br /><br />13:30 - Proceed to the Bridge over the River Kwai and walk over the black iron bridge, brought by Japanese from Java during World War II. Enjoy seeing the surrounding atmosphere before leaving for the Tiger Temple&nbsp;<br /><br />15:00 - Visit the Tiger Temple of Luangta Mahabua. Built in 1994, the temple gradually gained a worldwide reputation as wildlife sanctuary for various types of animals, especially for tigers.... From a very early age, all tigers are tame as they were hand-raised by human.&nbsp;<br /><br />17:00 - Depart Kanchanaburi for Bangkok&nbsp;<br /><br />19:00 - Arrive Bangkok&nbsp;<br />&nbsp;</p>',50,313,22594,'<p>Pick up Time 0630 Hrs</p><p>Drop at Hotel 1900 Hrs</p><ul><li><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></li><li><strong>Emergency contact: Mr Num 0830769322</strong></li><li><strong>Office mobile no:&nbsp; 0943517644</strong></li></ul><p>Lunch at Local thai Restaurant&nbsp;</p><p><strong>Note :-&nbsp;</strong>Please call at least 24 hours prior to departure to confirm schedule. Pick up and drop off are available at all the major city hotels except hotels located outside city limit. SIC available for hotels in city center located in area of Silom, Sathorn, Siam Square, Pratunam, Chidlom, Ploenchit, Sukhumvit Road (Soi 1-55 only) SIC Tour is require a minimum of 2 persons. Important Note: - Do not dress in red / Orange or bright color - Temples require politely dress no flowing skirts or scarves - No shorts and sleeveless shirts</p>',0,0),(97,'Ripleys believe it or not Museam on SIC','ripleys.jpg','','','','<p>Ripley&#39;s World of Entertainment is located on 2nd&nbsp;Floor of Royal Garden Plaza, Pattaya. It features world class entertainment attractions where everybody can enjoy, relax, and entertain friends, family and colleagues during weekends, vacations and all other occasions.</p><p>Welcome to the World&rsquo;s most unusual museum, Ripley&#39;s Believe It or Not! Museum in Pattaya. The museum features are 350 fascinating real exhibits and things you can&rsquo;t see anywhere else. Be exhilarated with Ripley&rsquo;s 4D Moving Theater, a high-tech simulator amusement ride guaranteed to thrill both the mind and body. Venture into your worst nightmares at Ripley&rsquo;s Haunted Adventure. Be dazzled with imaginable special effects and live actors that will send shivers down your spine from the moment you enter &lsquo;til the time you escape! Journey into new magical worlds at Ripley&rsquo;s Infinity Maze. A 20-minutes trip into the Maze will challenge your perception, mesmerize all your senses and make your question reality! Also the most unique &quot;toy&quot; in town Wax Hand Fun. Try it... see how much fun and amazing your hand can be</p>',32,313,22714,'<p>Opening Hours: 11:00 &ndash; 23:00</p><p>Min 2 Pax required</p><p>&nbsp;</p><p><strong>Includes:&nbsp;</strong></p><ul><li>Admission fee as mentioned on this program.&nbsp;</li><li>Round trip airport transfer from Hotel</li></ul><p>Excludes:</p><ul><li>Personal expenses such as drinks, tips, insurance etc.&nbsp;</li><li>Meal&nbsp;</li><li>Other service not mentioned on this program &nbsp;</li></ul><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p>',0,0),(98,'The Canal Tour on sic ','Bangkok-Canal-Tour_1.jpg','','','','<p>Bangkok&#39;s charming riverside is brimming with stories to tell. On&nbsp;this&nbsp;morning tour, a long-tailed speedboat whisks you down the&nbsp;<strong>Chao Phraya River&nbsp;</strong>and canals (khlongs) of Thonburi &ndash; the original site where Bangkok was founded, before King Rama I moved the capital&#39;s epicentre across the river to the Rattanakosin Island.</p><p>Immerse yourself in the picturesque riverside scenery, as you drift past stilted wooden homes, &#39;floating kitchens&#39;, mobile shops, colonial mansions and all kinds of colourful culture along the riverfront, before stopping at the enchanting&nbsp;<strong>Temple of Dawn</strong>&nbsp;(Wat Arun).</p><p>The trip passes the&nbsp;<strong>Royal Barges Museum</strong>, housing the eight elaborately decked longboats used in the highly ceremonial and rare Royal Barge Procession. With the combined tour, experience the above plus a trip to the&nbsp;<strong>Grand Palace</strong>, which reveals the splendour of early Rattanakosin architecture as well as&nbsp;<strong>Temple of the Emerald Buddha</strong>&nbsp;(Wat Phra Kaew).</p>',27,313,22594,'<p>Pick up 0830 hrs&nbsp;</p><ul><li><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></li><li><strong>Emergency contact: Mr Num 0830769322</strong></li><li><strong>Office mobile no:&nbsp; 0943517644</strong></li></ul><p>Includes:</p><ul><li>Air-conditioned vehicle with an English-speaking guide</li><li>Admission fee as mentioned on this program</li><li>Transfer from/to hotel.</li></ul><p>Excludes:</p><ul><li>Personal expenses such as drinks, tips, insurance, etc</li><li>Other services not mentioned on this programme</li><li>Meal</li></ul><p>&nbsp;</p><p>Note :-&nbsp;Please call at least 24 hours prior to departure to confirm schedule. Pick up and drop off are available at all the major city hotels except hotels located outside city limit. SIC available for hotels in city center located in area of Silom, Sathorn, Siam Square, Pratunam, Chidlom, Ploenchit, Sukhumvit Road (Soi 1-55 only) SIC Tour is require a minimum of 2 persons.</p>',0,0),(99,'The Crocodile Farm and The Elephant Theme Show on sic ','IMG_26333-Medium.jpg','','','','<p><strong>Tour itinerary:</strong><br /><br />12:00-12:30 - Pick up at your hotel and depart for Samphran, about 30 km south of Bangkok<br /><br />At Samphran Elephant Ground &amp; Zoo, there are many acitivities that you can relax or amuse yourself, such as taking photos with tigers, visiting the zoo and the crocodile farm, and seeing a magical show. The highlight of this tour is the Crocodile Wrestling Show and Elephant Theme Show.&nbsp;<br /><br />Crocodile Wrestling Show - see exciting crocodile wrestling where stunt trainers show how to catch, pull and wrestle with the crocodiles. Some breath-taking scenes show the stuntman putting his hand or head into the mouth of the crocodile...&nbsp;<br /><br />Elephant Theme Show, said to be the world&#39;s largest Elephant Theme Show where huge elephants perform amazing tasks and games, such as playing football, dancing, racing, and etc. You can also see dramatic show of how these elephants are used in royal battles and how a wild elephant is captured.&nbsp;<br /><br />15:30-16:00 - Depart from Samphran Elephant Ground &amp; Zoo&nbsp;<br /><br />17:00-17:00 - Arrive Bangkok and transfer you back to the hotel.&nbsp;</p>',20,313,22594,'<p>Pick up time 1230 hrs&nbsp;</p><ul><li><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></li><li><strong>Emergency contact: Mr Num 0830769322</strong></li><li><strong>Office mobile no:&nbsp; 0943517644</strong></li></ul><p>&nbsp;</p><p>Note :- Please call at least 24 hours prior to departure to confirm schedule. Pick up and drop off are available at all the major city hotels except hotels located outside city limit. SIC available for hotels in city center located in area of Silom, Sathorn, Siam Square, Pratunam, Chidlom, Ploenchit, Sukhumvit Road (Soi 1-55 only) SIC Tour is require a minimum of 2 persons.</p>',0,0),(100,'Half day Damnern Saduak Floating Market  on sic','floating.jpg','','','','<p>Floating markets offer fascinating cultural experiences as well as glimpses into the local way of life of a bygone era. Damnoen Saduak, the biggest and most popular of all floating markets, caters mainly to foreign visitors and is still a must-see, while smaller markets, such as Tha Kha and Ampawa, offer more local flavours. If you like outdoor markets and street-side shopping, you will definitely enjoy a day out at one of the floating markets surrounding Bangkok</p>',12,313,22594,'<p>Pick up Time 0700 hrs&nbsp;</p><p>Duration 5 hrs</p><ul><li><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></li><li><strong>Emergency contact: Mr Num 0830769322</strong></li><li><strong>Office mobile no:&nbsp; 0943517644</strong></li></ul><p>&nbsp;</p><p>Please call at least 24 hours prior to departure to confirm schedule. Pick up and drop off are available at all the major city hotels except hotels located outside city limit. SIC available for hotels in city center located in area of Silom, Sathorn, Siam Square, Pratunam, Chidlom, Ploenchit, Sukhumvit Road (Soi 1-55 only) SIC Tour is require a minimum of 2 persons.</p>',0,0),(101,'The Royal Grand Palace and the Emerald Buddha Temple + gems gallery  on sic ','pic1.jpg','','','','<p>If there is one must-see sight that no visit to Bangkok would be complete without, it&#39;s the dazzling, spectacular Grand Palace, undoubtedly the city&#39;s most famous landmark. Built in 1782 - and for 150 years the home of the Thai King, the Royal court and the administrative seat of government - the Grand Palace of Bangkok is a grand old dame indeed, that continues to have visitors in awe with its beautiful architecture and intricate detail, all of which is a proud salute to the creativity and craftsmanship of Thai people. Within its walls were also the Thai war ministry, state departments, and even the mint. Today, the complex remains the spiritual heart of the Thai Kingdom.</p>',28,313,22594,'<p>Pick up 0830 hrs&nbsp;</p><p>Durantion 04 Hrs&nbsp;</p><ul><li><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></li><li><strong>Emergency contact: Mr Num 0830769322</strong></li><li><strong>Office mobile no:&nbsp; 0943517644</strong></li></ul><p>Note :-&nbsp;Please call at least 24 hours prior to departure to confirm schedule. Pick up and drop off are available at all the major city hotels except hotels located outside city limit. SIC available for hotels in city center located in area of Silom, Sathorn, Siam Square, Pratunam, Chidlom, Ploenchit, Sukhumvit Road (Soi 1-55 only) SIC Tour is require a minimum of 2 persons.</p>',0,0),(102,'Half day bangkok city tour with 01 temple + gems gallery on sic ','STANDING BUDDHA.jpg','','','','<p>The 32-meter (100-foot) tall standing Buddha of Wat Indrawiharn used to be visible from just about any high vantage point around the old city. Now it&#39;s hidden behind the new buildings from Thailand&#39;s boom years of the 1980s and 90s.</p>',5,313,22594,'<p>Pick up time 1000 hrs&nbsp;</p><p>Duration 3 hrs&nbsp;</p><ul><li><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></li><li><strong>Emergency contact: Mr Num 0830769322</strong></li><li><strong>Office mobile no:&nbsp; 0943517644</strong></li></ul><p>Note :-&nbsp;Please call at least 24 hours prior to departure to confirm schedule. Pick up and drop off are available at all the major city hotels except hotels located outside city limit. SIC available for hotels in city center located in area of Silom, Sathorn, Siam Square, Pratunam, Chidlom, Ploenchit, Sukhumvit Road (Soi 1-55 only) SIC Tour is require a minimum of 2 persons.</p>',0,0),(103,'Phuket fantasia show with dinner on sic ','phuket_fantasea_show_w...','','','','<p><em><strong>Itinerary&nbsp;</strong></em></p><p>17:00 - 18:30</p><p>Pick up from hotel&#39;s lobby</p><p>18:15 - 21:00</p><p>The road from the Carnival Village leads to the blue lake, in which floats the beautiful Golden Pavilion, entrance to the world&rsquo;s grandest 4,000-seat dining facility -- the Golden Kinnaree Buffet Restaurant. Here mythical kinnarees - half-bird and half-woman of legendary beauty and graciousness - look after their guests like proverbial kings. A midst a mystical Himmaphan forest setting, visitors can indulge in a sumptuous feast of Royal Thai dishes and delicacies from popular international cuisine, prepared by some of Thailand&#39;s finest chefs. Buffet dinner time: 18:00 - 21:00</p><p>21:00 - 22:15</p><p>Fantasy Of A Kingdom&rdquo; Culture-Illusion Show The ultimate in Las Vegas-style theatrical productions. Created by international experts and local professionals, this audio-visual extravaganza incorporates, for the first time, nine stunning show themes Thai culture, magical illusions, 4-dimensional effects, aerial performance, acrobatics, indoor pyrotechnics, special effects, elephant circus and stunts into one unforgettable theatrical masterpiece guaranteed to thrill and delight visitors of all ages and nationalities.</p><p>22:30</p><p>Transfer back to the Hotel</p>',57,313,22744,'<p><strong>Duratuion 03&nbsp;hrs</strong></p><p><!--[if !supportLists]--><strong>1.&nbsp;&nbsp;&nbsp; </strong><!--[endif]--><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></p><p><!--[if !supportLists]--><strong>2.&nbsp;&nbsp;&nbsp; </strong><!--[endif]--><strong>Emergency contact: Mr Num 0830769322</strong><!--[if !supportLists]--></p><p><strong>3.&nbsp;&nbsp;&nbsp; </strong><!--[endif]--><strong>Office mobile no:&nbsp; 0943517644</strong></p><p>&nbsp;</p><p><em><strong>Remarks :</strong></em></p><ul><li>&nbsp;Normal show 21:00 &ndash; 22:15 hrs.&nbsp;</li><li>&nbsp;Buffet dinner time 18:00 &ndash; 21:00 hrs. For normal 21:00 hrs. Show, 20:45 &ndash; 22:00 hrs.</li><li>&nbsp;Operating days : Everyday, except Thursday</li></ul><p><strong>Important Note:-</strong></p><p>1. Pick up and drop off are available at all the major city hotels in Patong, Kata, Karon Kamala and Phuket Town. Supplement charge will be applied for pick up and drop off from other area. Program is subject to change according to the weather and local conditions. SIC Tour is require a minimum of 2 persons. PRIVATE TOUR is mean for private land transfer only, other services are bases on join-in services.</p><p>2.&nbsp; Please call at least 24 hours prior to departure to confirm schedule.</p>',0,0),(104,'Phuket Fantasea show with dinner ticket only ','phuket_fantasea_show_w...','','','','<p><em><strong>Itinerary&nbsp;</strong></em></p><p>18:15 - 21:00</p><p>The road from the Carnival Village leads to the blue lake, in which floats the beautiful Golden Pavilion, entrance to the world&rsquo;s grandest 4,000-seat dining facility -- the Golden Kinnaree Buffet Restaurant. Here mythical kinnarees - half-bird and half-woman of legendary beauty and graciousness - look after their guests like proverbial kings. A midst a mystical Himmaphan forest setting, visitors can indulge in a sumptuous feast of Royal Thai dishes and delicacies from popular international cuisine, prepared by some of Thailand&#39;s finest chefs. Buffet dinner time: 18:00 - 21:00</p><p>21:00 - 22:15</p><p>Fantasy Of A Kingdom&rdquo; Culture-Illusion Show The ultimate in Las Vegas-style theatrical productions. Created by international experts and local professionals, this audio-visual extravaganza incorporates, for the first time, nine stunning show themes Thai culture, magical illusions, 4-dimensional effects, aerial performance, acrobatics, indoor pyrotechnics, special effects, elephant circus and stunts into one unforgettable theatrical masterpiece guaranteed to thrill and delight visitors of all ages and nationalities.</p>',51,313,22744,'<p><strong>Duratuion 03&nbsp;hrs</strong></p><p><strong>1.&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></p><p><strong>2.&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>Emergency contact: Mr Num 0830769322</strong></p><p><strong>3.&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>Office mobile no:&nbsp; 0943517