s</p><p>4) Crocodile Kingdom&nbsp;</p><p>5) Various activities&nbsp;</p>',19,313,22714,'<p><strong>Opening hours :</strong>&nbsp;<strong>Opening Hours:&nbsp;</strong>Daily from 08:00 am. - 06:30 pm.&nbsp;<strong>Crocodile Shows: &nbsp;</strong>.09:00, 10:00, 11:00,<br />13:00, 14:00, 15:00, 16:00 &amp; 17:00 Hrs</p><p><strong>Includes:</strong></p><ul><li>Air conditioned vehicle.</li><li>Admission fee as mentioned on this program.&nbsp;</li><li>Transfer from/to hotel in Pattaya.&nbsp;</li></ul><p><strong>Excludes:</strong></p><ul><li>Personal expenses such as drinks, tips, insurance etc.&nbsp;</li><li>Other service not mentioned on this program.&nbsp;</li></ul><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p><strong>Min 2 Pax required</strong></p><p>&nbsp;</p><p><strong>NOTE</strong>: Please call atlease 24 hours prior to departure to confirm the schedule.</p><p>&nbsp;</p>',0,0),(106,'Million Years Stone Park with crocodile farm (Ticket only)','gal-show31.jpg','','','','<p>The Million Years Stone Park and Crocodile Farm located on an over-70-acre piece of land, this Park &amp; Farm is a new striking tourist attraction created with more than 20 years&#39; efforts, for all nature lovers.<br /><br />For over 30 years since his youth, Khun Suan had made every effort to collect natural objects that are valuable because of their rarity or oddity, such as Thai-style trained trees that are more than 200 years old from the early Rattanakosin period, fossilized tree trunks that are aged millions of years, and stratified rocks that are so colourful, in the hope that one day he would be able to build a tourist spot for people from far and near and those of future generations, to view and admire together his collection of natural wonders and to study and learn from the actual things instead of text books, pictures and hearsay which would be then only choices if the actual ob