nce in 1981. The Temple is entirely built with wood. The beauty of the Temple is elaborated through wood dwellings and woodcarvings.</p><p>It is considered an exotic and imposing architectural work of art of the century, embellishing with artwork and woodcarvings which reflects the intellect and spirit of the Eastern civilization and art. It also reflects the importance of religion which has helped to uphold the world. The Temple received the award of Outstanding Tourist Attraction from the Tourism Industry Awards in 2008.</p>',19,313,22714,'<p>Opening Hours:&nbsp;Daily from 08:00 am. - 05:00 pm.</p><p>Within the Temple compound, the dolphin training is shown daily at 11:30 am. and 03:30 pm.</p><p>Inclusions:</p><p>Round trip airport transfers from Hotel.</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>Min &nbsp;2 Pax required&nbsp;</p><p>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</p>',0,0),(112,'Siam Niramit Phuket Show ( Ticket + sic Transfers )','siam_niramit_phuket_show_(silver_seat)_7_hover.jpg','','','','<p>This must-see spectacular show features over 100 performers, lavish costumes and stunning set designs.Enhanced special effects and the world&#39;s most advanced technology are used to produce a very realistic, stimulating and inspiring experience.</p><p><em><strong>Itinerary&nbsp;</strong></em></p><p>17:00 - 17:30</p><p>Pick up at the hotel lobby. (17:30 gates opened for access to attractions and facilities.)</p><p>20:30</p><p>Show Starts (show duration is 70 mins.)</p><p>22:00 - 22:30</p><p>Transfer Back to the Hotel.</p>',36,313,22744,'<p><strong>Duration 03 hrs</strong></p><ol><li><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></li><li><strong>Emergency contact: Mr Num 0830769322</strong></li><li><strong>Office mobile no:&nbsp; 0943517644</strong></li></ol><p><strong>Remark:&n