e mobile no:&nbsp; 0943517644</strong></li></ol><p><strong>Remark:&nbsp;</strong><br />Operating days: Everyday, except Tuesday</p><p><strong>Important Note:-</strong></p><p>1. Pick up and drop off are available at all the major city hotels in Patong, Kata, Karon Kamala and Phuket Town. Supplement charge will be applied for pick up and drop off from other area. Program is subject to change according to the weather and local conditions. SIC Tour is require a minimum of 2 persons. PRIVATE TOUR is mean for private land transfer only, other services are bases on join-in services.</p><p>2.&nbsp; Please call at least 24 hours prior to departure to confirm schedule.</p>',0,0),(115,'Pattaya Elephant Village (Ticket Only)','40110025.jpg','','','','<p>Pattaya Elephant Village showcases daily life of elephants and their masters. It also offers stage shows, which demonstrate how to catch wild elephants, elephants-at-work in the jungle, elephants playing football, a grand war and elephants&#39; parades. Elephant rides around the village are recommended. The one-hour-long elephant shows are held at 2.30pm</p><p>Pattaya Elephant Village was opened in 1973 as a sanctuary for former working elephants. These elephants, through reasons of injury or ill health, can no longer be used as a part of the backbone of heavy work in the jungles of Thailand. Also because of their diminishing habitat, it is now longer possible to return them to the wild.<br /><br />The Elephant Village provides then magnificent creatures with a safe haven, where they may live out their lives with dignity and freedom from fear. A visit to the Elephant Village is not only unique experience, but it is also a lifesaver because the fees paid by our visitors contribute to, the very survival of the elephants, both now and in the future.</p>',34,313,22714,'<p>Operating time: 08.00 - 17.30</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>Min &nbsp;2 Pax required&nbsp;</p><p>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</p>',0,0),(116,'Pattaya Elephant Village (Ticket + SIC Transfers)','40110025.jpg','','','','<p>Pattaya Elephant Village showcases daily life of elephants and their masters. It also offers stage shows, which demonstrate how to catch wild elephants, elephants-at-work in the jungle, elephants playing football, a grand war and elephants&#39; parades. Elephant rides around the village are recommended. The one-hour-long elephant shows are held at 2.30pm</p><p>Pattaya Elephant Village was opened in 1973 as a sanctuary for former working elephants. These elephants, through reasons of injury or ill health, can no longer be used as a part of the backbone of heavy work in the jungles of Thailand. Also because of their diminishing habitat, it is now longer possible to return them to the wild.<br /><br />The Elephant Village provides then magnificent creatures with a safe haven, where they may live out their lives with dignity and freedom from fear. A visit to the Elephant Village is not only unique experience, but it is also a lifesaver because the fees paid by our visitors contribute to, the very survival of the elephants, both now and in the future.</p>',46,313,22714,'<p>Operating time: 08.00 - 17.30</p><p>&nbsp;</p><p>Inclusions:</p><p>Round Trip Pattaya&nbsp;hotel transfers&nbsp;</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>Min &nbsp;2 Pax required&nbsp;</p><p>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</p>',0,0),(117,'Pattaya Tower Shoot (Ticket only)','Pattaya-Park-Thailand-.jpg','','','','<p>&nbsp;</p><p>The Pattaya Park at Chomthian features a large water park with giant sliders and a tower with a revolving restaurant, which offers a panoramic view of P