ally, visitors can enjoy the museum interactively by taking photos of your posture with 3d illusion painting or even touching the painting. Besides, its location is really great since it is in the city, Near North Pattaya Big C Supercenter.</p>',6,313,22714,'<p>Opening Hours: 09:00 - 2000 Hrs</p><p>&nbsp;</p><p>Inclusions:</p><p>Ticket &nbsp;Only</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>Min &nbsp;2 Pax required&nbsp;</p><p>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</p>',0,0),(129,'Art in Paradise Pattaya (Ticket + SIC transfers)','Thailand_2014-44.jpg','','','','<p><strong>Art in Paradise Pattaya is another great place for tourists to visit in Pattaya City because it is, in the present, the first and only one illusion art museum - the museum presenting Anamorphosis. Additionally, visitors can enjoy the museum interactively by taking photos of your posture with 3d illusion painting or even touching the painting. Besides, its location is really great since it is in the city, Near North Pattaya Big C Supercenter.</strong></p>',13,313,22714,'<p>Opening Hours: 09:00 - 2000 Hrs</p><p>&nbsp;</p><p>Inclusions:</p><p>Ticket &nbsp;Only + Round trip airport transfers on SIC</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>Min &nbsp;2 Pax required&nbsp;</p><p>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</p><p>&nbsp;</p>',0,0),(130,'Simon Cabaret Show ( Ticket only )','phuket_simon_cabaret_show_(regular_seat)_6_hover.jpg','','','','<p>Let your imagination fly... Since opening in October 18, 1991, Phuket Simon Cabaret has established itself as a market leader of professional entertainment venue. For sheer entertainment, our set designs are outstanding, costume extravagant and the performer&rsquo;s glamorous. In the exclusive, luxurious and intimate theater with hi-tech sound and lighting equipment. Our show is truly international featuring modern and traditional acts from around the globe in English and alternative languages. You will arrive relaxed but will leave confuse as our performers is more of a man than you will ever be and even more of a woman too.</p><p>Itinerary&nbsp;</p><p>18:00</p><p>1st show :Extravagant costumes, make-up and sets take the audience from Egypt to Latin America to China and back to Thailand in themed displays of classical dance and song.</p><p>19:45</p><p>2nd show :Extravagant costumes, make-up and sets take the audience from Egypt to Latin America to China and back to Thailand in themed displays of classical dance and song.</p><p>21:30</p><p>3rd show :Extravagant costumes, make-up and sets take the audience from Egypt to Latin America to China and back to Thailand in themed displays of classical dance and song.</p>',18,313,22744,'<p><strong>Duration 03 hrs</strong></p><ol><li><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></li><li><strong>Emergency contact: Mr Num 0830769322</strong></li><li><strong>Office mobile no:&nbsp; 0943517644</strong></li></ol><p>&nbsp;</p><p><strong>Important Note:-</strong></p><p>1. Pick up and drop off are available at all the major city hotels in Patong, Kata, Karon Kamala and Phuket Town. Supplement charge will be applied for pick up and drop off from other area. Program is subject to change according to the weather and local conditions. SIC Tour is require a minimum of 2 persons. PRIVATE TOUR is mean for private land transfer only, other services are bases on join-in services.</p><p>2.&nbsp; Please call at least 24 hours prior to departure to confirm schedule.</p>',0,0),(131,'Simon Cabaret Show ( Ticket + sic Transfers)','phuket_simon_cabaret_show_(regular_seat)_6_hover.jpg','','','','<p>Let your imagination fly... Since opening in October 18, 1991, Phuket Simon Cabaret has established itself as a market leader of professional entertainment venue. For sheer entertainment, our set designs are outstanding, costume extravagant and the performer&rsquo;s glamorous. In the exclusive, luxurious and intimate theater with hi-tech sound and lighting equipment. Our show is truly international featuring modern and traditional acts from around the globe in English and alternative languages. You will arrive relaxed but will leave confuse as our performers is more of a man than you will ever be and even more of a woman too.</p><p>Itinerary&nbsp;</p><p>18:00</p><p>1st show :Extravagant costumes, make-up and sets take the audience from Egypt to Latin America to China and back to Thailand in themed displays of classical dance and song.</p><p>19:45</p><p>2nd show :Extravagant costumes, make-up and sets take the audience from Egypt to Latin America to China and back to Thailand in themed displays of classical dance and song.</p><p>21:30</p><p>3rd show :Extravagant costumes, make-up and sets take the audience from Egypt to Latin America to China and back to Thailand in themed displays of classical dance and song.</p>',24,313,22744,'<p><strong>Duration 03 hrs</strong></p><ol><li><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></li><li><strong>Emergency contact: Mr Num 0830769322</strong></li><li><strong>Office mobile no:&nbsp; 0943517644</strong></li></ol><p>&nbsp;</p><p><strong>Important Note:-</strong></p><p>1. Pick up and drop off are available at all the major city hotels in Patong, Kata, Karon Kamala and Phuket Town. Supplement charge will be applied for pick up and drop off from other area. Program is subject to change according to the weather and local conditions. SIC Tour is require a minimum of 2 persons. PRIVATE TOUR is mean for private land transfer only, other services are bases on join-in services.</p><p>2.&nbsp; Please call at least 24 hours prior to departure to confirm schedule.</p>',0,0),(132,'Half day Krabi City Tour on Pvt ( 2 Pax only)','10589446313_3b440ff65c_b.jpg','','','','<p>We start in the morning at 09:00 am from hotel lobby for Krabi city tour. First, we bring you to Khao Kanab Nam for sightseeing along the Krabi River by traditional long tailed boat. We visit many nice places such as caves where you can see the stalagmites and stalactites with many bats inside, mangroves forests where you may see some monkeys, water monitors and many other kinds of animals that live in this wide Mangrove Forest. Then go back to the pier and we will visit Krabi Town; a good place for shopping.<br />After that we will take you to Tiger Cave Temple (Wat Tham Sua), which is one of the most beautiful temples in Krabi. Its surroundings have a quiet atmosphere with plants and flowers and are suitable for relaxing and learning meditation. There are several caves where you can find limestone stalagmites and stalactites. Many big trees can be found in the temple&rsquo;s area. On top of the mountain stands a golden pagoda with more than 1000 steps to reach it, but beautiful views of Krabi town and Khao Kanab Nam is well worth the effort.<br />Susan Hoi (Shell Cemetery) &ndash; The shell graveyard at Ban Laem Poh was once a large fresh water swamp, home to a kind of freshwater snail. About 40 million years ago, it is believed that millions of these snails lived in the swamps and later there was big flooding and seawater got into the swamps and all of the snails died and formed layers upon each other. This shelly limestone is now distributed in great broken sheets of impressive magnitude on the seashore at Laem Poh Cape. You can also buy some souvenirs such as shell products, hats, handbags, pearl, etc from the shops at Susan Hoi. After visiting this interesting place, we will then get back to the hotel to relax.</p>',66,313,22684,'<p>Tour Duration: 09.00 &ndash; 13.00</p><p>&nbsp;</p><p>Note:<br />Tour includes: Entrance Fee / Longtail Boat / life jackets / Drinking water / Guide / Minivan / Insurance</p><p>Excludes: Lunch&nbsp;</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>Min &nbsp;2 Pax required&nbsp;</p><p>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</p>',0,0),(133,'Half day Krabi City Tour (3-6 pax)','tiger cave.jpg','picture-435.jpg','','','<p>We start in the morning at 09:00 am from hotel lobby for Krabi city tour. First, we bring you to Khao Kanab Nam for sightseeing along the Krabi River by traditional long tailed boat. We visit many nice places such as caves where you can see the stalagmites and stalactites with many bats inside, mangroves forests where you may see some monkeys, water monitors and many other kinds of animals that live in this wide Mangrove Forest. Then go back to the pier and we will visit Krabi Town; a good place for shopping.<br />After that we will take you to Tiger Cave Temple (Wat Tham Sua), which is one of the most beautiful temples in Krabi. Its surroundings have a quiet atmosphere with plants and flowers and are suitable for relaxing and learning meditation. There are several caves where you can find limestone stalagmites and stalactites. Many big trees can be found in the temple&rsquo;s area. On top of the mountain stands a golden pagoda with more than 1000 steps to reach it, but beautiful views of Krabi town and Khao Kanab Nam is well worth the effort.<br />Susan Hoi (Shell Cemetery) &ndash; The shell graveyard at Ban Laem Poh was once a large fresh water swamp, home to a kind of freshwater snail. About 40 million years ago, it is believed that millions of these snails lived in the swamps and later there was big flooding and seawater got into the swamps and all of the snails died and formed layers upon each other. This shelly limestone is now distributed in great broken sheets of impressive magnitude on the seashore at Laem Poh Cape. You can also buy some souvenirs such as shell products, hats, handbags, pearl, etc from the shops at Susan Hoi. After visiting this interesting place, we will then get back to the hotel to relax.</p>',48,313,22684,'<p>Tour Duration: 09.00 &ndash; 13.00</p><p>&nbsp;</p><p>Note:<br />Tour includes: Entrance Fee / Longtail Boat / life jackets / Drinking water / Guide / Minivan / Insurance</p><p>Excludes: Lunch&nbsp;</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>Min &nbsp;2 Pax required&nbsp;</p><p>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</p>',0,0),(134,'Hot spring & Emerald Lagoon + Elephant riding (SIC)','150415183756.jpg','','','','<p>Krabi&rsquo;s natural attractions are not only islands and beaches. Firstly, this tour will take you to Hot Spring or hot stream where you can get the real natural relaxation by dipping yourself in the stream. The Hot Spring in this area is hotter than any others nearby. The minerals and the temperature (38-42c) of the springs are ideal for Hydrotherapy bath. The area is covered by rainforest and shady trees. You can also explore a lowland rainforest area, which is known as a home to Gurney&rsquo;s Pitta bird, once believed extinct.<br />After the Hot spring, then we take you to the Emerald Lagoon where you have to walk about 1,200 metres through the rainforests to explore the different species of plants and animals. Then you will enjoy swimming in the Emerald Lagoon with green and clear water.<br />Lunch is served in the local restaurant. After that, we drive you to an elephant camp. It&rsquo;s time to explore the jungle on the back of the world biggest land animal; an elephant. Even though, the elephants are big, they are always gentle and friendly to human. After the elephant ride, we will take you back to your hotel to relax.</p>',52,313,22684,'<p>Tour Duration: 08.30 &ndash; 16.00<br />Operated: Daily ( Minimum 2 pax )</p><p>&nbsp;</p><p><strong>If Guest is staying at Railay Bay area, Pick &amp; Drop cost will be extra and will be collected from the guest in Krabi only</strong></p><p>&nbsp;</p><p><strong>What to bring:</strong><br />- Sun cream / Sunglasses<br />- Sun hat / Towel<br />- Camera<br />- Dry clothes to change<br />- Swim suit<br />- Comfortable shoes</p><p><br /><strong>Tour includes:</strong><br />- Round trip transfer from hotel<br />- National Park entrance fee<br />- Set Lunch from a restaurant<br />- English speaking guide<br />- Insurance</p><p>&nbsp;</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</p>',0,0),(135,'HALF DAY KAYAKING AT AO THALANE WITH LUNCH','kayaking.jpg','kayaking 2.jpg','','','<p>08:30 &ndash; 08:45 Pick up from your hotel, arrive at the pier and depart by Sea Kayak to the mangrove forest &ndash; AoThalane.<br />About half way along the coast between Than Bok Khoranee and Krabi town is a bay of mangroves that may be the most beautiful bay in Thailand. Here, bays and canyons are like passageways.<br />Recently, this place has been discovered that it is superb for having a first time encounter with the ecosystem. In addition, there are very rich faunas and plants that are not found easily. The region contains good examples of traditional local villages. Certainly, a highlight of the trip is narrow channels cut through two towering cliffs. Several species of Kingfishers, little Herons and Crab Eating Macaques are almost guaranteed to be seen in this area. Ao Thalane has not yet officially designated as a national park but it may soon become one.<br />If lucky, you may have a chance to see the monkeys or macaques coming very close to you while you are paddling. These monkeys come for food. They know that you must have something they can eat. Please be careful with your camera and belongings. Naughty monkeys like to take away the tourists&rsquo; belongings.<br />After that, we get back to the pier, get change and enjoy lunch from the restaurant with nice view and then we transfer you back to the hotel.</p>',34,313,22684,'<p>&nbsp;</p><p>Tour Duration: 08.30 &ndash; 13.00<br />Operated: Daily ( Minimum 2 pax )</p><p>&nbsp;</p><p><strong>If Guest is staying at Railay Bay area, Pick &amp; Drop cost will be extra and will be collected from the guest in Krabi only</strong></p><p>&nbsp;</p><p><em><strong>What to bring:</strong></em><br />Sun cream / Sun glasses / Sun hat<br />Towels / Camera<br />Dry clothes to change<br />Swim suit</p><p><br /><em><strong>Tour includes:</strong></em><br />Roundtrip transfer from hotel<br />Life jackets / Dry bag<br />Drinking water<br /><strong>Set lunch</strong><br />Kayak boat (Self paddling)<br />English speaking guide</p><p>&nbsp;</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>Min &nbsp;2 Pax required&nbsp;</p><p>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</p><p>&nbsp;</p>',0,0),(136,'FULL DAY KAYAKING AT AO THALANE WITH LUNCH','kayaking 2.jpg','kayaking.jpg','','','<p>08:30 &ndash; 08:45 Pick up from your hotel, arrive at the pier and depart by Sea Kayak to the mangrove forest &ndash; AoThalane.<br />About half way along the coast between Than Bok Khoranee and Krabi town is a bay of mangroves that may be the most beautiful bay in Thailand. Here, bays and canyons are like passageways.<br />Recently, this place has been discovered that it is superb for having a first time encounter with the ecosystem. In addition, there are very rich faunas and plants that are not found easily. The region contains good examples of traditional local villages. Certainly, a highlight of the trip is narrow channels cut through two towering cliffs. Several species of Kingfishers, little Herons and Crab Eating Macaques are almost guaranteed to be seen in this area. Ao Thalane has not yet officially designated as a national park but it may soon become one.<br />Lunch will be served in the restaurant at Ao Thalane. In the afternoon, we will carry on Ao Thalane exploration to see more forests, animals and scenery. If lucky, you may have a chance to see the monkeys or macaques coming very close to you while you are paddling. These monkeys come for food. They know that you must have something they can eat. Please be careful with your camera and belongings. Naughty monkeys like to take away the tourists&rsquo; belongings.<br />After that, we get back to the pier, get change and transfer back to the hotel.</p>',48,313,22684,'<p>Tour Duration: 08.30 &ndash; 15.30<br />Operated: Daily ( Minimum 2 pax )</p><p>&nbsp;</p><p><strong>If Guest is staying at Railay Bay area, Pick &amp; Drop cost will be extra and will be collected from the guest in Krabi only</strong></p><p>&nbsp;</p><p><strong>What to bring:</strong><br />Sun cream / Sun glasses / Sun hat<br />Towels / Camera /<br />Dry clothes to change<br />Swim suit / Sandal</p><p><br /><strong>Tour includes:</strong><br />Roundtrip transfer from hotel<br />Life jackets / Dry bag<br />Drinking water<br />Kayak boat ( Self paddling )<br />Lunch at local restaurant<br />English speaking guide , Insurance</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</p><p>&nbsp;</p>',0,0),(137,'Full day Koh Hong kayaking with lunch','ADA8DX-1680x1050.jpg','','','','<p>08:30 &ndash; 08:45 Pick up from your hotel to Ao Thalane Pier. Then you will be transferred by long-tailed boat from the pier to Hong Island. The journey takes about 45 minutes but you will absolutely forget the time once the boat left from the pier. The scenery around Hong Island is very nice with different rock formations. When you arrive at the island then it&rsquo;s time to paddle the kayak around the island or if you think the paddling is too hard, you may choose to relax on the beach, feed the fishes or swim in the clear water.<br />Hong Island stands out as one of the most beautiful islands of the Andaman coast. As you approach from the sea to the beach, you will see the towering limestone formations and crystal clear water inspiring the images of the island of dream. Pilay beach was boasted a powder white sandy beach with colorful corals and marine lives. Koh Hong&rsquo;s name comes from the Thai word &ldquo;Hong&rdquo; which means &ldquo;room&rdquo;. In the middle of beautiful island there lies a hidden lagoon spot for local fishermen and is also one place where bird nests are collected. The coral reefs here are amazing. Many species of colored tropical fishes also can be found here.<br />Lunch is on the beach near National park office. In the afternoon, you have free time for swimming and self-paddling. After sightseeing around Koh Hong, then we return to Ao Thalane Pier, get change and get back to the hotel.</p>',57,313,22684,'<p>Tour Duration: 08:30 &ndash; 16:00<br />Operated: Daily: ( Minimum 2 pax )</p><p>&nbsp;</p><p><strong>If Guest is staying at Railay Bay area, Pick &amp; Drop cost will be extra and will be collected from the guest in Krabi only</strong></p><p>&nbsp;</p><p><strong>What to bring:</strong><br />Sun cream / Sun glasses / Sun hat<br />Towels / Camera / Dry clothes to change<br />Swim suit / Sandal</p><p><br /><strong>Tour includes:</strong><br />Roundtrip transfer from hotel<br />Life jackets, masks &amp; snorkels<br />Drinking water / Entrance Fee<br />Kayak Boat<br />Long-tailed Boat to Hong Island<br />Picnic lunch on the beach<br />English speaking guide</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>Min &nbsp;2 Pax required&nbsp;</p><p>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</p><p>&nbsp;</p>',0,0),(138,'FULL DAY KAYAKING KOH HONG & AO THALANE WITH LUNCH','ADA8DX-1680x1050.jpg','','','','<p>08:30 &ndash; 08:45 Pick up from your hotel to Ao Thalane Pier. Then you will be transferred by long tailed boat from the pier to Hong Island. The journey takes about 45 minutes but you will absolutely forget<br />the time once the boat left from the pier. The scenery around Hong Island is very nice with different rock formations. When you arrive at the island then it&rsquo;s time to paddle the kayak around the island or if you think the paddling is too hard, you may also relax on the beach, feed the fish or swim in the clear water of the Andaman Sea.<br />Koh Hong is also called Koh Lao Billeh. This island&rsquo;s shape is like half-circle. You will enjoy the spectacular views of the sea and the surrounding islands when you paddle the kayak. There are lots of shallow coral reefs and breathtaking lagoon ( the symbol of the island ) to see.<br />Lunch will be served in the restaurant at Ao Thalane.<br />In the afternoon, we will explore Ao Thalane, surrounded by towering karsts formation and lovely offshore islands, is complex channels, bay and canyon-like passageway. Recently, this place has been discovered that it is superb for having a first time encounter with the ecosystem. Certainly, a highlight of the trip is narrow channels cut through two towering cliffs. Several species of Kingfishers, little Herons and Crab-Eating Macaques are almost guaranteed to be seen in this area. Ao Thalane has not yet officially been designated as a national park but it may soon become one. Then we paddle back to Ao Thalane Pier, get change and go back to the hotel to relax.</p><p>Note: Tour program is depending on the tide and weather condition.</p>',64,313,22684,'<p>Type of Vehicle: Van / Long-tailed boat + Kayak<br />Tour Duration: 08:30 &ndash; 16:30<br />Operated: Daily ( Minimum 2 pax )</p><p>&nbsp;</p><p><strong>If Guest is staying at Railay Bay area, Pick &amp; Drop cost will be extra and will be collected from the guest in Krabi only</strong></p><p>&nbsp;</p><p><strong>What to bring:</strong><br />Sun cream / Sun glasses / Sun hat<br />Towels / Camera / Dry clothes to change<br />Swim suit / Sandal</p><p><br /><strong>Tour includes:</strong><br />Roundtrip transfer from hotel<br />Life jackets, masks &amp; snorkels<br />Drinking water / Dry bag<br />Lunch / Entrance Fee<br />Long-tailed boat to Hong Island<br />English speaking guide,</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>Min &nbsp;2 Pax required&nbsp;</p><p>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</p><p>&nbsp;</p>',0,0),(139,'Full day Phi Phi Island by speed boat','1.1266574588.right-sid...','','','','<p>08:30 Pick up from your hotel to the pier.<br />Phi Phi Island is said to be one of the most beautiful islands in the world. It is also a good site for Scuba diving. In the morning, we will take you to Nopparatthara Pier to get on speedboat. The journey by speedboat is approx. 45 minutes. The tour program is relying on the weather and tide condition so we can not confirm where to stop first or second. However, today we will visit Maya Bay, the most famous beach on Phi Phi Island, Pileh Cove, monkey beach, Viking Cave that was renamed by H.M. King Bhumibhol when he visited the cave in 1972, &ldquo;Tam Phaya Nak&rdquo;. &lsquo;Tam Phaya Nak&rsquo; means the cave of Naga; the great serpent of Buddhist legend. It is a place much revered by the local people who came here to collect the swift&rsquo;s nests that were used to make Bird Nest Soup; a Chinese delicacy. Phi Phi Lay Island composes of limestone and steep cliffs rising up from the sea. This is a good place for scuba diving, sightseeing, snorkeling and swimming. There are many nice beaches with white sand to visit.<br />Included Buffet lunch is served in the local restaurant on Phi Phi Don Island. You can also buy some drinks by yourself and pay direct to the restaurant.<br />After lunch, we will take you to some other nice places for swimming or snorkeling such as Bamboo island, an island with nice white sandy beach. At about 15:30, we will depart from Phi Phi Island for Krabi and then we transfer you back to your hotel to relax.</p>',52,313,22684,'<p>Type of Vehicle: Speed boat<br />Tour Duration: 08:30 &ndash; 16.30<br />Operated: Daily. Min. 2 pax.</p><p>&nbsp;</p><p><strong>If Guest is staying at Railay Bay area, Pick &amp; Drop cost will be extra and will be collected from the guest in Krabi only</strong></p><p>&nbsp;</p><p><strong>What to bring:</strong><br />- Sun cream / Sunglasses / Sun hat<br />- Towels / Camera / Pocket money<br />- Dry clothes to change<br />- Swim suit / Sandal</p><p><br /><strong>Tour includes:</strong><br />- Round trip transfer from hotel<br />- Speedboat<br />- Life jackets, mask &amp; snorkel<br />- National Park entrance fee<br />- Drinking water and fruits<br />- Buffet Lunch in a restaurant<br />- English speaking guide</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>Min &nbsp;2 Pax required&nbsp;</p><p>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</p><p>&nbsp;</p>',0,0),(140,'Poda (4islands) by speed boat (picnic lunch)','PodaIsland3.jpg','','','','<p>08:30 &ndash; 08:45 Pick up from your hotel to Nopparatthara Beach and then speedboat will take you to Tab Island. The island is composed of 2 small islands &ndash; Koh Tub and Koh Mor which are joined together with sand bars. You can see the sand bars only when it is the proper low tide.<br />There are also other islands to visit as well; Kai Island (or Chicken Island); an amazing rock formation as the big head of Ostrich or chicken. You will see a lot of small colorful fishes when snorkeling in this area.<br />Have picnic lunch on the beach at Poda Island; an island with white sandy beaches, clear water and schools of colorful fishes in abundance. It is a perfect place for snorkeling or swimming.<br />In the afternoon, visit Phranang Cave and Phranang Beach to swim or just relax on the nice beach. Around 15:00, we return to Nopparatthara Beach and then transfer back to the hotel to relax.</p>',38,313,22684,'<p>Type of Vehicle : Speed boat&nbsp;<br />Tour Duration: 08.30 &ndash; 15.00<br />Operated: Daily Min. 2 pax</p><p>&nbsp;</p><p><strong>If Guest is staying at Railay Bay area, Pick &amp; Drop cost will be extra and will be collected from the guest in Krabi only</strong></p><p>&nbsp;</p><p><strong>What to bring:</strong><br />Sun cream / Sun glasses / Sun hat<br />Towels / Camera<br />Dry clothes to change<br />Swimming suit / Sandal</p><p><br /><strong>Tour includes:</strong><br />Roundtrip transfer from hotel<br />Life jackets, masks &amp; snorkels for snorkeling<br />Drinking water / Entrance Fee<br />Picnic Lunch for tour by speedboat<br />Lunch Box for tour by long tailed boat<br />English speaking guide,</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</p><p>&nbsp;</p>',0,0),(141,'Poda (4island) by long tailed boat (lunch box)','poda-island-krabi.jpg','','','','<p>08:30 &ndash; 08:45 Pick up from your hotel to Nopparatthara Beach and then speedboat will take you to Tab Island. The island is composed of 2 small islands &ndash; Koh Tub and Koh Mor which are joined together with sand bars. You can see the sand bars only when it is the proper low tide.<br />There are also other islands to visit as well; Kai Island (or Chicken Island); an amazing rock formation as the big head of Ostrich or chicken. You will see a lot of small colorful fishes when snorkeling in this area.<br />Have picnic lunch on the beach at Poda Island; an island with white sandy beaches, clear water and schools of colorful fishes in abundance. It is a perfect place for snorkeling or swimming.<br />In the afternoon, visit Phranang Cave and Phranang Beach to swim or just relax on the nice beach. Around 15:00, we return to Nopparatthara Beach and then transfer back to the hotel to relax.</p>',19,313,22684,'<p>Type of Vehicle : Speed boat / Long tailed boat<br />Tour Duration: 08.30 &ndash; 15.00<br /><strong>Operated: Daily Min. 2 pax</strong></p><p>&nbsp;</p><p><strong>If Guest is staying at Railay Bay area, Pick &amp; Drop cost will be extra and will be collected from the guest in Krabi only</strong></p><p>&nbsp;</p><p><strong>What to bring:</strong><br />Sun cream / Sun glasses / Sun hat<br />Towels / Camera<br />Dry clothes to change<br />Swimming suit / Sandal</p><p><br /><strong>Tour includes:</strong><br />Roundtrip transfer from hotel<br />Life jackets, masks &amp; snorkels for snorkeling<br />Drinking water / Entrance Fee<br />Picnic Lunch for tour by speedboat<br />Lunch Box for tour by long tailed boat<br />English speaking guide,</p>',0,0),(142,'Full day Koh Hong by speed boat (picnic lunch)','maxresdefault (1).jpg','','','','<p>08:30 Pick up by minivan from your hotel to Nopparat Thara Pier. Then you will get on the speedboat and transfer to Hong Island. On the way to Hong Island, we will stop for snorkeling at a small island with colorful coral reef and marine life. Then we head for Hong Island. The captain will take you into the hidden Lagoon or &lsquo;Hong&rsquo; which means &lsquo;Room&rsquo;. You will be amazed by the rock formation and strange plants living on the cliffs. Then we stop at Hong Island Bay. It&rsquo;s time for you to relax, sunbath, swim or snorkel to see thousands of fish that will come around you.<br />We will have picnic lunch on the beach at Hong Island Bay under the shade of the trees. If you are lucky, you may see water monitors or big lizards on this island.<br />In the afternoon, we head for Pak Bia Island, stop on the beach and relax or walk on the soft sandy beach. Then we will take you to the last island for today, &lsquo;Lading Island. You can swim here or meet the colorful fish that will surround you once you dip yourself into the water. They are always hungry, so if you have a piece of bread or fruits, they will absolutely love you. At about 15h00, we will get on the speedboat and return to Nopparat Thara Pier, then transfer back to your hotel around 16h00.<br />Note: The program subject to change depending on the weather and tide condition.</p>',50,313,22684,'<p>&nbsp;</p><p>Type of Vehicle: Minivan + Speedboat<br />Tour Duration: 08:30 &ndash; 16:00<br />Operated: Daily (Minimum 2 pax)</p><p>&nbsp;</p><p><strong>If Guest is staying at Railay Bay area, Pick &amp; Drop cost will be extra and will be collected from the guest in Krabi only</strong></p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>Min &nbsp;2 Pax required&nbsp;</p><p>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</p><p>&nbsp;</p>',0,0),(143,'James Bond Island by long tailed boat + Lunch +  Canoe + Elephant ','james bond mmm.jpg','','','','<p>08:00 &ndash; 08:15 Pick up from your hotel by minibus to Phang Nga pier and get aboard long tailed boat to enjoy the spectacular scenery of Phang Nga Bay National Park. While traveling on the long tailed boat, you will be amazed by the scenery of mangrove forest, rocks formation in strange shapes such as Khao Majoo and the limestone cave at Tham Lod where you can get through the hole to another side. After that, we will visit Khao Ping-Gan of which the name means literally &lsquo;leaning mountain&rsquo;. It is really a huge rock split in two; the smaller half has slid down and the remaining one appears now to be leaning. Though Kao Ping-gan is a very small island, another one is still smaller, Koh Tapoo or known as &ldquo;James Bond Island&rdquo;. It is situated in a little bay of Khao Ping-gan where a lot of visiting boats pull up. Tapoo means nail and this shore less rock projects up from the sea as its name implies: flat and wide at the top and very narrow at waterline. The island became more famous after the James Bond adventure film called &ldquo;The Man with the Golden Gun&rdquo; was partly filmed here.<br />We will have lunch at local restaurant &amp; shopping at Panyee Island. &ldquo;Panyee Island&rdquo; has a picturesque village, which rests on small pilings and extends out across the water. It is inhabited mostly by Muslim fishermen, whose unique culture has still existed for more than a hundred year. Souvenir shops and seafood restaurants are ready to serve all visitors from around the world. In the afternoon, the long tailed boat takes you back to Pier on mainland and then we will visit Elephant camp for elephant riding. You will also have a chance to see rubber plantation before coming back to Krabi.</p>',62,313,22684,'<p>Type of Vehicle: Van + Long tailed boat<br />Duration Tour: 08.00 &ndash; 17.00<br />Operated on: Daily ( Minimum 2 pax )</p><p><strong>If Guest is staying at Railay Bay area, Pick &amp; Drop cost will be extra and will be collected from the guest in Krabi only</strong></p><p>&nbsp;</p><p><strong>What to bring:</strong><br />Sun cream / Sun glasses<br />Camera , Comfortable shoes</p><p><br /><strong>Tour includes:</strong><br />Roundtrip transfer by minivan<br />Life jackets / long tailed boat<br />Canoeing / Elephant Ride<br />Drinking water / Entrance Fee<br />Lunch at local restaurant<br />English speaking guide</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>Min &nbsp;2 Pax required&nbsp;</p><p>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</p><p>&nbsp;</p>',0,0),(144,'Ban Bor Thor Sea Cave canoeing + Lunch','1155947688.jpg','','','','<p>08:00 &ndash; 08:30 Pick up from your hotel by minivan and transfer to Bor Thor Village. When you arrive at the pier, the local guide will tell you some useful information about the paddling and mangrove forests. When everyone is ready, then we start the cave expedition by kayaking (Self paddling).<br />Bor Thor Village, located in the North of Krabi province, is home to the historical sites of Tham Lod and Pee Hua Toh Cave. Kayaking is the most practical way to explore these sea caves. At Tham Lod, you can paddle from one side of the limestone pinnacle through a tunnel to the other side. The tunnel gives you splendid sightings of stalactites and stalagmites. You can also see the strange shapes of rocks in the form of mermaid and etc. It depends on your imagination.<br />Pee Hua Toh Cave, the cave comes from the Carboniferous to Permian period, 230 &ndash; 340 million years ago. There are prehistoric wall paintings in the cave and also stalactites, stalagmites and tubular stones. It was reported that Big skulls of human were found here and that why we name the cave &ldquo;Pee Hua Toh&rdquo; which means &ldquo;big headed ghost&rdquo;.<br />Lunch will be served at the floating restaurant near the mangrove forests. In the afternoon, we will explore some more caves such as &ldquo;Tham Song Pee Nong&rdquo;.<br />About 16:00 Hrs, we will take you back to the hotel to relax.</p>',50,313,22684,'<p>Type of Vehicle: Van + Kayak boat<br />Tour Duration: 08.00 &ndash; 16.00<br />Operated: Daily ( Minimum 2 pax )</p><p><strong>If Guest is stayi