y Big Boat','james_bond_big boat.jpg','','','','<p>Land transfer by air conditioned vehicle to Ao Por Pier for approximately 40 minutes for James Bond Canoe&rsquo;s trip. Depart from pier and head to Phang-nga Bay on cruise, coffee, tea, soft drink and seasonal fruit will be available during the trip. The short introduction of the day&rsquo;s excursion will be explained. Arrive at Phang-Nga by and &ldquo;discover&rdquo; Koh Pank, visit a bat cave by canoe for approximately 30 minutes. Arrive at Koh Hong and explore the beautiful location by canoe for approximately 30 minutes. Koh Hong, with big and small mountains. Gives you a feeling of being surrounded in a large hall with two doors. It will give you and immense feeling of the power of nature&rsquo;s creation. Return to cruise, enjoy onboard with Thai style lunch while the boat slowly cruise to Kao Ping Gun (James Bond Island). Enjoy sightseeing and visit Kao Ping Gun, also know as &ldquo;James Bond Island from the movie&rdquo; The Man with the golden gun. Stop for free activities here like walking and photos approximately 30 minutes. Depart from Kao Ping Gun and head to Lawa Island, there you will enjoy swimming, relaxing on the beach, sun bathing or either Kayaking self-paddle for approximately 1 hrs. Hrs. Leave from Lawa Island and return to Ao Por Bay Pier. Arrive at the pier and transfer back to your hotel with wonderful experience to remember.</p><p><em><strong>Remarks </strong></em>:<br /> Pick up 07:30 &ndash; 07:45 Hrs. (Patong Beach, Kata, Karon Beach) /</p><p>&nbsp; &nbsp; Pick up 08:20 &ndash; 08:30 Hrs (Kamala Beach)<br /> Pick up 08:30 &ndash; 08:45 Hrs. (Bangtao Beach)&nbsp;</p><p>&nbsp; &nbsp; Pick up 08:45 &ndash; 09:00 Hrs. (Laguna Area)</p><p>&nbsp;</p><p>Tour Includes :&nbsp;<br />- Round trip transfer from the hotel by air-con minibus&nbsp;<br />- Big Boat<br />- Canoeing gears, Paddle<br />- Life jacket<br />- Soft drinks and fruits<br />- Lunch<br />- English speaking guide<br /><br />What to wear :&nbsp;<br />- Short &amp; T-shirt, non slip shoes, Light cotton clothing<br /><br />What to bring :&nbsp;<br />- Swimwear<br />- Beach Towel<br />- Sun block lotion<br />- Sunglasses<br />- Camera &amp; battery</p>',47,313,22744,'<p><strong>Pick from Hotel&nbsp;</strong></p><p><strong>Lunch included&nbsp;</strong></p><p><em><strong>Pick up area Patong , karon and Kata Only&nbsp;</strong></em></p><p><em><strong>If any other area extra charges apply&nbsp;</strong></em></p><p><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></p><p><strong>Emergency contact: Mr Num 0830769322</strong></p><p><strong>Office mobile no:&nbsp; 0943517644</strong></p><p><strong>Min &nbsp;2 Pax required&nbsp;</strong></p><p><strong>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</strong></p>',0,0),(149,'James Bond Island with lunch   by Long Tailed Boat','7976547336_79b37e23ec.jpg','','','','<p>Pick up time from hotel lobby. Arrive Monkey Cave (Suwankuha Temple). Appreciate the interior the surrounding cave and pay respect to the great beauty the 15 meters long reclining Buddha Image. Depart from the Monkey Temple to the Pier and take long tail boat to enjoy viewing the spectacular scenery of Phang Nga Bay National Park. The surrounding mangrove forest, Sea Caves (Tum Talu) Khao Ping Ngan and Khao Tapoo, better well know as &ldquo;James Bond Island&rdquo; (The Man with the Golden Gun). Afternoon, visit Muslim Village &ldquo;Koh Panyi&rdquo; and observe a fisherman life style in a village. Lunch at local restaurant at Koh Panyee. Depart for Phuket.</p><p><em><strong>Remarks :</strong></em><br /> Pick up between 09:30 - 10:00 Hrs. at lobby for long tailed Boat, back to hotel 18:00 hrs. (Patong Area only)</p><p>&nbsp;</p><p>Tour Includes :&nbsp;<br />- Round trip transfer from the hotel by air-con minibus&nbsp;<br />- Long tail&nbsp;&nbsp;Boat<br />- Canoeing gears, Paddle<br />- Life jacket<br />- Soft drinks and fruits<br />- Lunch<br /