><em><strong>If any other area extra charges apply&nbsp;</strong></em></p><p><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></p><p><strong>Emergency contact: Mr Num 0830769322</strong></p><p><strong>Office mobile no:&nbsp; 0943517644</strong></p><p><strong>Min &nbsp;2 Pax required&nbsp;</strong></p><p><strong>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</strong></p>',0,0),(156,'Koh Samui half day City Tour (SIC)','Big-buddha-temple.jpg','','','','<p>&nbsp;</p><p>The first stop will be Ladd Koh View Point for panoramic view of famous Chaweng Beach which powdery<br />white sandy contrasting to the clear blue sea.<br />Next stop at a marvelous strange natural formation of Grand Ma &amp; Grand Pa rock have been fashioned<br />by the elements into massive sculptures, creating a lot of humorous interest from tourists.<br />Wat Kunaram for pay respect to the mummified body of Luang Por Daeng, the sacrosanct for native, he<br />died more than 30 years ago in a sitting position of meditation his body shows few signs of any major<br />decay (un-decomposed).<br />Then we stop at Na Muang 1 Waterfall and being impressive with the wide drop of 18 meters cascade to<br />a natural pool below.<br />You have time for shopping at Nathon town, the capital of Koh Samui, a place where the pier is for<br />embarkation to the mainland. Samui products, beach wears can be found.<br />Big Buddha, a large statue of Lord Buddha image is dominating on a hill top of a small island which can<br />be reached by walking up the steps to the big gallery for the surrounding bird&rsquo;s eye view.<br />Sea shells and Coconut shells product are available for shopping as well.</p><p>&nbsp;</p>',25,313,22674,'<p><strong>Koh Samui City Tour SIC (Half Day only - No Lunch)</strong></p><p>&nbsp;</p><p><strong>Pick Up Time from Samui Hotel : Approx 0900 Hrs</strong></p><p><strong>Returning time: Approx 1400 Hrs</strong></p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p><strong>NOTE: Guide will not wait for more than 5 Mnts.</strong></p><p>&nbsp;</p>',0,0),(157,'Koh Samui City Tour + Lunch + Aquarium + Tiger Show ( SIC )','excursion-samui-aquarium-tiger-zoo-thailand-october-show-seals-48617720.jpg','','','','<p>&nbsp;</p><p>The first stop will be Ladd Koh View Point for panoramic view of famous Chaweng Beach which powdery<br />white sandy contrasting to the clear blue sea.<br />Next stop at a marvelous strange natural formation of Grand Ma &amp; Grand Pa rock have been fashioned<br />by the elements into massive sculptures, creating a lot of humorous interest from tourists.<br />Wat Kunaram for pay respect to the mummified body of Luang Por Daeng, the sacrosanct for native, he<br />died more than 30 years ago in a sitting position of meditation his body shows few signs of any major<br />decay (un-decomposed).<br />Then we stop at Na Muang 1 Waterfall and being impressive with the wide drop of 18 meters cascade to<br />a natural pool below.<br />You have time for shopping at Nathon town, the capital of Koh Samui, a place where the pier is for<br />embarkation to the mainland. Samui products, beach wears can be found.<br />Big Buddha, a large statue of Lord Buddha image is dominating on a hill top of a small island which can<br />be reached by walking up the steps to the big gallery for the surrounding bird&rsquo;s eye view.<br />Sea shells and Coconut shells product are available for shopping as well.</p><p><br />Visit to Samui Aquarium and watch Bengal Tiger show, Sea Lion show and Bird show.<br />Both the aquarium and the zoo have many of Thailand&#39;s tropical favourites above and below the water.<br />You will explore diversity kinds of fish , huge catfish and several sharks including Leopard and Black Tips<br />Samui&#39;s local zoo adjacent to the aquarium, house some south-eastern Asian tigers, parrots, hornbills,<br />sea hawks, eagles or even otters who will perform for you.<br />Thai set lunch will be served at local restaurant.<br />&nbsp;</p>',64,313,22674,'<p><strong>MINIMUM 4 PAX REQUIRED&nbsp;</strong></p><p>Pick up time from Samui Hotel - Approx 0900 Hrs</p><p>Drop at Hotel : 1630 Hrs</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p><strong>REMARK: </strong></p><p>In case of the clients stay at Intercontinental Baan Taling Ngam hotel , Banburee Resort &amp; Four Season<br />Resort, Sasha Casavela, Kamalaya Resort, Kanokburi resort, Conrad hotel , The Passage resort, Mai Samui &amp;<br />Nikki Beach. We&#39;ll operate only transfer on private basis at additional&nbsp;cost.</p><p>&nbsp;</p><p>NOTE: Guide will not wait for more than 5 Mnts.</p><p>&nbsp;</p>',0,0),(158,'Koh Tao & Koh Nang Yuan + Lunch  (Speed Boat - share basis)','324.jpg','00007801_tQgh2Sy_origi...','','','<p>A diving and snorkeling paradise, 70 km further north of Samui located in the clearest and best&nbsp;under water visibility in the Gulf of Thailand. It&rsquo;s a home of various coral species where you can find&nbsp;abundant of tropical marine life, giant clams, and colorful fish that you can feed them with bread by<br />your hand.<br />Starting early morning, we set the sail and heading north to the first snorkel point, that is Koh Nang Yuan&nbsp;which are joined together by white sand bars of 3 small islands. The journey takes about 1 hour and 30&nbsp;minutes. Upon arrival, put on your snorkeling gears and face down the impressively fantastic<br />underwater world. Many tourists prefer to climb up the mountain to the viewpoint of Nang Yuan - 90<br />meters - panoramic view.<br />After lunch in a Restaurant on Koh Tao the trip will extend to the second point at Ao Muang or at other&nbsp;prime site of Koh Tao depending on weather and tide condition.<br />Late afternoon, at about 15:00 pm, we will head back to Koh Samui and our arrival at the pier in Bophut&nbsp;Fisherman Village is at 16:30 pm</p>',59,313,22674,'<p>Picl Up Time from Samui Hotel : Around 0800 Hrs</p><p>Return : Around 1630 Hrs</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>NOTE: Guide will not wait for more than 5 Mnts.</p>',0,0),(159,'Angthong marine Park + Lunch (Tour Boat - Share Basis)','MP_T.jpg','','','','<p>This group of islands, 250 sq.kms., is located 45 kms north-west from Koh Samui. It takes about 2 hours<br />by tour boat and 1 hour by speedboat or by yacht. Visitors will be enchanting wonderland composed of<br />bulbous green isles, clear blue lagoons, mysterious caves and strange shapes of rock formations.<br />The 2nd National Park created in Thailand, which comprises some 40 islands covering area of 250<br />sq.kms. Most islands comprise limestone masses, reaching heights up to 450 meters, has blanketed by 4<br />difference types of forest such as Dry Evergreen Forest, Beach Forest, Limestone Forest and Mangrove<br />Forest. There are many strange rock formations brought above by erosion of the earth and one island<br />has a mysterious sink hole, completely enclosed by walls of sheer rock, on its center.<br />Transfer to the Pier, board the speed boat to Angthong National Marine Park. You will arrive at Koh Wao<br />or Koh Tai Plow for snorkeling, a nice place for fish and wonderful coral reefs. Then we do sightseeing<br />around the National Marine Park. Climb up the steps to see the wonderful &ldquo; Emerald Lake &ldquo; known as<br />Talay Nai, surrounded by the mountain.<br />Buffet lunch at The National Marine Park for speed boat and on board for Tour boat. Afternoon,<br />Relaxing on the beach, swimming or climbing up to the mountain&rsquo;s top to see the fantastic panoramic<br />view of Angthong Marine Park . 15.00 starts cruising back to Koh Samui and transfer to your hotel.</p><p><strong>Note:</strong> You can choose between speedboat, tour boat ( There is no Koh Wao / Tai plow in the program by&nbsp;tourboat)</p>',42,313,22674,'<p>Pick Up from Samui Hotel: Approx 0730 Hrs</p><p>Return: Approx 1730 Hrs</p><p>&nbsp;</p><p><strong>REMARK:</strong></p><p>In case of the clients stay at Intercontinental Baan Taling Ngam hotel , Banburee Resort &amp; Four Season<br />Resort, Sasha Casavela, Kamalaya Resort, Kanokburi resort, Conrad hotel , The Passage resort, Mai Samui &amp;<br />Nikki Beach. We&#39;ll operate only transfer on private basis at additional&nbsp;cost.</p><p><strong>NOTE: Guide will not wait for more than 5 Mnts.</strong></p><p>&nbsp;</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p>',0,0),(160,'Angthong Marine Park + Lunch (Speed Boat  - No Kayaking) - Share basis','MP_T.jpg','','','','<p>This group of islands, 250 sq.kms., is located 45 kms north-west from Koh Samui. It takes about 2 hours&nbsp;by tour boat and 1 hour by speedboat or by yacht. Visitors will be enchanting wonderland composed of&nbsp;bulbous green isles, clear blue lagoons, mysterious caves and strange shapes of rock formations.<br />The 2nd National Park created in Thailand, which comprises some 40 islands covering area of 250&nbsp;sq.kms. Most islands comprise limestone masses, reaching heights up to 450 meters, has blanketed by 4&nbsp;difference types of forest such as Dry Evergreen Forest, Beach Forest, Limestone Forest and Mangrove&nbsp;Forest. There are many strange rock formations brought above by erosion of the earth and one island<br />has a mysterious sink hole, completely enclosed by walls of sheer rock, on its center.<br />Transfer to the Pier, board the speed boat to Angthong National Marine Park. You will arrive at Koh Wao&nbsp;or Koh Tai Plow for snorkeling, a nice place for fish and wonderful coral reefs. Then we do sightseeing&nbsp;round the National Marine Park. Climb up the steps to see the wonderful &ldquo; Emerald Lake &ldquo; known as&nbsp;Talay Nai, surrounded by the mountain.<br />Buffet lunch at The National Marine Park for speed boat and on board for Tour boat. Afternoon,<br />Relaxing on the beach, swimming or climbing up to the mountain&rsquo;s top to see the fantastic panoramic<br />view of Angthong Marine Park . 15.00 starts cruising back to Koh Samui and transfer to your hotel.</p><p>Note:&nbsp;You can choose between speedboat, tour boat ( There is no Koh Wao / Tai plow in the program by&nbsp;tourboat)</p>',60,313,22674,'<p>Pick Up from Samui Hotel: Approx 0730 Hrs</p><p>Return: Approx 1730 Hrs</p><p>&nbsp;</p><p><strong>REMARK:</strong></p><p>In case of the clients stay at Intercontinental Baan Taling Ngam hotel , Banburee Resort &amp; Four Season<br />Resort, Sasha Casavela, Kamalaya Resort, Kanokburi resort, Conrad hotel , The Passage resort, Mai Samui &amp;<br />Nikki Beach. We&#39;ll operate only transfer on private basis at additional&nbsp;cost.</p><p><strong>NOTE:</strong> Guide will not wait for more than 5 Mnts.</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p>',0,0),(161,'Angthong marine Park + kayaking + Lunch (Tour Boat only) - share basis','angthong-national-marine-park-koh-samui-tour1.jpg','','','','<p>KAYAKING TOUR is a joined trip on tour boat to Angthong National Marine Park.<br />The 1st stop will be at the Coast of Koh Mae Island where you navigate beneath huge rock overhanging&nbsp;and view some of the most magnificent scenery the Gulf has to offer.<br />Landing the kayaks on the beach you take an easy but spectacular climb through dense rainforest and&nbsp;narrow ravines to arrive at the &ldquo;Green Lagoon&rdquo;, a beautiful emerald salty water lake.&nbsp;</p><p>Get back to the boat for buffet lunch as we cruise along the stunning northern region of the Park.<br />Arrive at Tai Plow for the second expedition.<br />Here you will discover magical caves and bizarre rock formations and have plenty of time to explore the&nbsp;underwater sights.</p>',58,313,22674,'<p>Pick up from Samui Hotel: Around 0730 Hrs</p><p>Return : around 1700 Hrs</p><p>&nbsp;</p><p><strong>REMARK:</strong></p><p>In case of the clients stay at Intercontinental Baan Taling Ngam hotel , Banburee Resort &amp; Four Season<br />Resort, Sasha Casavela, Kamalaya Resort, Kanokburi resort, Conrad hotel , The Passage resort, Mai Samui &amp;<br />Nikki Beach. We&#39;ll operate only transfer on private basis at additional&nbsp;cost.</p><p><strong>NOTE:&nbsp;Guide will not wait for more than 5 Mnts.</strong></p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p>',0,0),(162,'Indian meal coupons Bangkok','event_113919002.jpeg','','','','<p>Indian Buffet&nbsp;</p><p>Lunch timimg 13.00 to 1500 hrs</p><p>Diiner timing 20.00 to 22.00 hrs</p>',7,313,22594,'<p>Indian restaurant names&nbsp;</p><p><em><strong>Sukhumvit areas&nbsp;</strong></em></p><p>1. Great punjab</p><p>2. India gate&nbsp;</p><p><em><strong>Pratunam area</strong></em></p><p>1. New garam masala</p><p>2. Asian Delight</p><p>3. Curry Pot</p><p>4. Indian dosa&nbsp;</p><p><strong>Emergency contact: Ms Fon 0891599379, 0830541636</strong></p><p><strong>Emergency contact: Mr Num 0830769322</strong></p><p><strong>Office mobile no:&nbsp; 0943517644</strong></p><p><strong>Please call at least 24 hours prior to departure to confirm schedule</strong></p>',0,0),(163,'Coral Island Tour Samui + Lunch (Long Tailed Boat)','DSC__1001.jpg','','','','<p>This is Koh Samui&rsquo;s neighboring island which is 20 minutes cruising by long tailed boat. This rustic<br />tranquility place is called &ldquo;Coral island&rdquo;. It is a primitive island with a small pristine village and still no car<br />and no roads. The island is surrounded by coral reefs along the white sandy beaches that both<br />snorkelers and sun bathing lovers can join together.<br />In the morning we depart from your hotel to Thong Krut Village for embarkation to the Coral island .<br />If you like to do snorkeling, you have to swim out about 20 meters away. For those who want to take a&nbsp;nap on a quiet get away beach or sunbathing, just lie down on a pure white sandy beach under your<br />footsteps.<br />After that we cruise to Koh Mudsum for Picnic lunch on the beach.<br />Then you have free time for swimming and snorkeling until about 14.30 pm, then we cruise back to the&nbsp;pier at Koh Samui and transfer back to hotel.</p>',38,313,22674,'<p>Pick up time from Samui Hotel: &nbsp;Around 0830 Hrs</p><p>Return: Around 1530 Hrs</p><p>&nbsp;</p><p>REMARK:</p><p>In case of the clients stay at Intercontinental Baan Taling Ngam hotel , Banburee Resort &amp; Four Season<br />Resort, Sasha Casavela, Kamalaya Resort, Kanokburi resort, Conrad hotel , The Passage resort, Mai Samui &amp;<br />Nikki Beach. We&#39;ll operate only transfer on private basis at additional&nbsp;cost.</p><p>NOTE:&nbsp;Guide will not wait for more than 5 Mnts.</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>&nbsp;</p>',0,0),(164,'Koh Phangan Tour (Breakfast + Lunch ) Speed boat - share basis','koh mah.jpg','','','','<p>You will be picked up by van from your hotel to Bangrak Pier. We have some light breakfast for you&nbsp;before onboard speedboat and depart for Koh Phangan.<br />The speedboat will drop off all guests at Thongsala Pier and then you will be transferred by local&nbsp;songthaew to visit many interesting local sites such as Chinese Temple, elephant camps and fishermen&nbsp;village.<br />Koh Phangan is located 20 kilometers north of Koh Samui. This island is famous for its &ldquo;Full Moon Party&rdquo;&nbsp;which is held on every full moon night. Koh Phangan also has lots of natural attractive sites such as&nbsp;waterfalls and many nice sandy beaches.<br />Koh Mah, a spectacular small island located north of Koh Phangan, has fascinating coral reefs which are&nbsp;good for snorkeling.<br />Hadd Rin is very well known for the location of the full moon party and its white sandy beach.<br />Next, you will visit Koh Mah for snorkeling or swimming and followed by nice lunch from local restaurant&nbsp;on the beach. After lunch, we will visit &ldquo;Kao Thum Temple&rdquo; and stop at scenic viewpoint for nice photo<br />shooting. The last thing we can&rsquo;t miss is to visit &ldquo;Haad Rin Beach&rdquo;; a famous place for full moon party.<br />Then back to Koh Samui and transfer back to you hotel at about 16:00.</p>',63,313,22674,'<p>Pick up from samui Hotel : Around 0830 Hrs</p><p>Return : Around 1630 Hrs</p><p>&nbsp;</p><p><strong>MINIMUM 4 PAX REQUIRED TO OPERATE THE TOUR</strong></p><p>&nbsp;</p><p><strong>REMARK:</strong></p><p>In case of the clients stay at Intercontinental Baan Taling Ngam hotel , Banburee Resort &amp; Four Season<br />Resort, Sasha Casavela, Kamalaya Resort, Kanokburi resort, Conrad hotel , The Passage resort, Mai Samui &amp;<br />Nikki Beach. We&#39;ll operate only transfer on private basis at additional&nbsp;cost.</p><p>NOTE:&nbsp;Guide will not wait for more than 5 Mnts.</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p><p>&nbsp;</p>',0,0),(165,'Koh Samui Adventure Tour + Lunch (SIC)','waterfall_4.jpg','','','','<p><strong>SAMUI ADVENTURE TOUR + LUNCH (SIC)</strong></p><p>Depart hotel by Pick up (Songthaew) for approximately 30 minutes drive to the south of Koh Samui.<br />Here, within beautiful scenery of the green forest is located the Elephant camp where the guests can see&nbsp;daily life activities of these huge animals, bathing, and how the elephant at work.<br />The program starts from the camp for soft trek on elephant back (elephant ride 2 pax / elephant) for 30&nbsp;minutes through the rainforest. Then we do 10 minutes Jungle walk to Namuang Waterfall 2 which is&nbsp;the highest waterfall of Koh Samui ( 80 m. ). Then you will have good time to swim in the cool fresh<br />water.<br /><strong>The Elephant show: </strong>You will be amazed by their intelligence and the way they follow their trainer&rsquo;s&nbsp;orders.<br />Monkey show: This animal is as similar as human except the fact it can&rsquo;t talk. Our Monkeys will welcomeyour friendly with they ability like human, sing a song, drinking milk by spoon and works on the coconut<br />trees.<br /><strong>Crocodile show:</strong> The crocodile is considered as the most aggressive and dangerous animal, but&nbsp;sometimes human can change the rules. You will be excited and enjoy this extreme show.<br />Bird show: Beautiful Macaws and not only they can fly but they know how to calculate and show bicycle<br />riding. You will love our unique birds and fresh water otter how to keep Samui clean.<br /><strong>Snake show:</strong> The shows featuring snakes indigenous to Samui as well as scorpion and how to fight with<br />King Cobra and Siamese Cobra. Thai set lunch will be served at local restaurant.<br />Then transfer back to the hotel.</p>',46,313,22674,'<p>Pick up time from samui Hotel: Approx 0830 Hrs</p><p>Returning: Approx 1400 Hrs</p><p>&nbsp;</p><p><strong>REMARK:</strong></p><p>In case of the clients stay at Intercontinental Baan Taling Ngam hotel , Banburee Resort &amp; Four Season<br />Resort, Sasha Casavela, Kamalaya Resort, Kanokburi resort, Conrad hotel , The Passage resort, Mai Samui &amp;<br />Nikki Beach. We&#39;ll operate only transfer on private basis at additional&nbsp;cost.</p><p>NOTE:&nbsp;Guide will not wait for more than 5 Mnts.</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p>',0,0),(166,'Eco Adventure Tour + Lunch (SIC)','Elephant-Trek-1.gif','','','','<p><strong>ECO ADVENTURE TOUR + Lunch (SIC)</strong></p><p>The 2 experiences of combination tours from the clear blue sea to the greenery mountainous, which&nbsp;will offer a good chance for snorkeling on pristine tranquilly isles of Koh Tan by a wooden long-tailed&nbsp;boat and ride an elephant trekking to the green woods, hiking to the mountain view point and waterfall.<br />You will learn to get to know how mahout can communicate with his gentle giant and how the life of&nbsp;elephant is. It&rsquo;s a very worthwhile which you can get 2 tours just in 1 day.<br />Pick up from hotels and transfers to the elephant camp. Enjoy<strong> elephant trekking</strong> to the rainforest and&nbsp;coconut plantation. Then watch the elephant show &amp; Monkey show . See how intelligent they are and&nbsp;know how to follow the trainer&rsquo;s commands. Then Thai boxing show.<br />After that take the <strong>4 x 4 jeep</strong> to visit the beautiful Namuang Waterfall cascading down the mountain,<br />relax and enjoy the tropical surroundings before drive up to the top of mountain to visit Tar Nim&nbsp;Waterfalll and the magic garden of stone sculpted statues. Just short drive away, visit the mountain&nbsp;viewpoint is a must.<br />Then <strong>lunch</strong> and relax at the sea view beach restaurant.<br />In the Afternoon take a local long tailed boat for 15 minutes to Koh Tan Island. Here you can spend your&nbsp;time in the underwater marine life and enjoy the natural beauty surrounded by blue sea with full of<br />beautiful and colorful coral reefs.</p>',50,313,22674,'<p>Pick Up from Samui Hotel : Approx 0900 Hrs</p><p>Return: 1700 Hrs</p><p>&nbsp;</p><p><strong>REMARK:</strong></p><p>In case of the clients stay at Intercontinental Baan Taling Ngam hotel , Banburee Resort &amp; Four Season<br />Resort, Sasha Casavela, Kamalaya Resort, Kanokburi resort, Conrad hotel , The Passage resort, Mai Samui &amp;<br />Nikki Beach. We&#39;ll operate only transfer on private basis at additional&nbsp;cost.</p><p>NOTE:&nbsp;Guide will not wait for more than 5 Mnts.</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p>',0,0),(167,'Canopy Adventure (SIC)','Anvaya-Cove-zip-line.jpg','maxresdefault.jpg','','','<p><strong>CANOPY ADVENTURE (SIC)</strong></p><p>Depart the hotel by pickup truck then experience the rainforest&rsquo;s flora and fauna on a short jungle trek<br />to the training area. There are 6 different tree houses, 4 separated cable rides.<br />Start gliding from tree house to another tree house above the rainforest, it&rsquo;s completely safe with&nbsp;highly trained staff on every platform. Drinks will be served at Jungle bar.</p>',56,313,22674,'<p>Pick up from Samui Hotel: Approx 1000 Hrs</p><p>Return: Approx : 1200 Hrs</p><p>&nbsp;</p><p><strong>REMARK:</strong></p><p>In case of the clients stay at Intercontinental Baan Taling Ngam hotel , Banburee Resort &amp; Four Season<br />Resort, Sasha Casavela, Kamalaya Resort, Kanokburi resort, Conrad hotel , The Passage resort, Mai Samui &amp;<br />Nikki Beach. We&#39;ll operate only transfer on private basis at additional&nbsp;cost.</p><p>&nbsp;</p><p><strong>NOTE:&nbsp;</strong>Guide will not wait for more than 5 Mnts.</p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p>',0,0),(168,'4x4 Off Road Mountain Trip + Lunch  (SIC)','11112329463_7cc3fd36e2_b.jpg','','','','<p><strong>4x4 Offroad Mountain Trip + Lunch (SIC)</strong></p><p>&nbsp;</p><p>First stop at Grand Father and Grand Mother Rock strangely shaped rock at south of Lamai beach.</p><p>Then visit the Oldest big tree 500 years old ( Dipterocarpacae ).On the way you can see the old rice field&nbsp;of Samui Island where many water buffalos can be seen.<br />Elephant show 66,000 intelligent points. You will be surprised by their intelligence and the way they&nbsp;follow their trainers&rsquo; commands.<br />Monkey show: The monkeys will welcome you with their ability like human such as singing a song,&nbsp;drinking milk by spoon and working on the coconut tree.<br />The crocodile is considered as the most aggressive and dangerous animal, but sometimes human power&nbsp;can change the rules. You will love our extreme show.<br />After the show finishes, then we take an elephant trekking along the waterfall and tropical rainforest.<br /><strong>Traditional Thai Lunch is included</strong>.<br />Jungle walk to Namuang waterfall 2 which is the highest waterfall of Koh Samui ( 80 m.). You will have&nbsp;time to swim in the cool fresh water. Next, drive up to the Magic Garden, located on the hill of Koh&nbsp;Samui. &ldquo;Uncle Nim&rdquo; started to build this garden in 1976 when he was 77 years old. All the sculptures are&nbsp;about Buddhism narration.<br />Stop at Mountain viewpoint 680 m. above sea level for a nice photo shooting. Then transfer back to&nbsp;hotel.<br />Recommended: Comfortable cloths, sun protection, Sunhat, swimming suit, nice shoes for jungle walk.</p>',50,313,22674,'<p>Pick up from samui Hotel : Approx 0900 Hrs</p><p>Return: 1630 Hrs</p><p><strong>REMARK:</strong></p><p>In case of the clients stay at Intercontinental Baan Taling Ngam hotel , Banburee Resort &amp; Four Season<br />Resort, Sasha Casavela, Kamalaya Resort, Kanokburi resort, Conrad hotel , The Passage resort, Mai Samui &amp;<br />Nikki Beach. We&#39;ll operate only transfer on private basis at additional&nbsp;cost.</p><p><strong>NOTE:&nbsp;Guide will not wait for more than 5 Mnts.</strong></p><p>&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>&nbsp;</p>',0,0),(185,'Phuket Half day City Tour on SIC','laempromthep.JPG','','','','<p><strong>PHUKET CITY TOUR SIC:</strong></p><p><strong>Inclusions:</strong></p><p>View point , leam promthep, chalong temple , kata temple , cashewnut factory.</p><p>NOTE: Pick up from Hotels located in&nbsp;Patong area only @ around 1000 Hrs</p>',13,313,22744,'<p>Excludes: Lunch&nbsp;</p><p>Emergency contact: Ms Fon 0891599379, 0830541636</p><p>Emergency contact: Mr Num 0830769322</p><p>Office mobile no:&nbsp; 0943517644</p><p>Min &nbsp;2 Pax required&nbsp;</p><p>NOTE:&nbsp;Please call atlease 24 hours prior to departure to confirm the schedule</p>',0,0);


